(818, 'Kate Cronin', '+447807976336', 'Cronin_kate@hotmail.com', '2020-05-25', 1, '04:00 PM', '05:00 PM', '<p>Dear Kate,</p>\n<p><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\">Thank you for contacting Xtreme Lashes.&nbsp;</span><br style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\" /><br style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\" /><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\">Classic Lash $1488, Hybrid Lash set $1888 (around 120-150 lashes each eye), new customer will enjoy an addiitonla 30% off on our standard pricing. Classic is about $1000. First treatment time around 2 hours, includes 15 mins for consultation.&nbsp;</span><br style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\" /><br style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\" /><br style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\" /><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\">Are you currently wearing eyelash extensions? We charge $350 for remove if you have more than 20 extensions in total, additional 20 - 30 mins needed.&nbsp;&nbsp;</span><br style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\" /><br style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\" /><br style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\" /><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\">We have availability at 4pm today.&nbsp; Appointment times are booked on a first come first serve basis. All requested are confirmed by text message prior to the appointment and subject to change due to technician availability.</span><br style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\" /><br style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\" /><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\">Our open hour Monday to Friday, 11am to 8pm, and Sat open at 10am. You may WhatsApp us for booking or any queries as well, here\'s our number: 91410363.&nbsp;&nbsp;</span><br style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\" /><br style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\" /><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\">May I know how do you come to hear about our salon?&nbsp;&nbsp;</span><br style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\" /><br style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\" /><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\">Should you have any question, please do not hesitate to contact us at any time.&nbsp;&nbsp;</span><br style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\" /><br style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\" /><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\">Have a lovely day!</span><br style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\" /><br style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\" /><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\">Regards,</span><br style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\" /><br style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\" /><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\">Xtreme Lashes Hong Kong (Tel:37088961)</span></p>', '2020-05-22 19:12:41', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
