ica, sans-serif; font-size: 13px;\" /><br style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\" />We have availability at 11am in Central, and checking availabilty at 2pm for you. &nbsp;<br style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\" /><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\">Appointment times are booked on a first come first serve basis. All requested are confirmed by text message prior to the appointment and subject to change due to technician availability.</span><br style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\" /><br style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\" /><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\">Our open hour&nbsp;</span><a style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\" href=\"x-apple-data-detectors://5\">Monday to Friday, 11am</a><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\">&nbsp;to 8pm, and Sat open&nbsp;</span><a style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\" href=\"x-apple-data-detectors://6\">at 10am</a><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\">.&nbsp;You may WhatsApp us for booking or any queries as well, here\'s our number:&nbsp;</span><a style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\" href=\"tel:91410363\">91410363</a><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\">.&nbsp;&nbsp;</span><br style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\" /><br style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\" /><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\">May I know how do you come to hear about our salon?&nbsp;&nbsp;</span><br style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\" /><br style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\" /><span