(70, 'Appointment request from PravdaKal', '<b>Appointment details:</b>\n			<br>Name: PravdaKal\n			<br>Phone: \n			<br>Email: nadezhda_timofeeva_92@mail.ru\n			<br>Message: *** \r\nВ управление президента по общественным проектам (УОП) может перейти президент Всероссийского студенческого корпуса спасателей — член Общественной палаты Алексей Аветисов, кандидатуру которого рассматривают на должность главы департамента по противодействию экстремизму среди молодежи, пишет «Коммерсантъ». \r\nНа должность начальника департамента по молодежной политике в УОП претендует глава Роспатриотцентра Ксения Разуваева. \r\nОбоим кандидатам для приема на работу предстоит пройти стандартную проверку в администрации президента. \r\nДепартамент по противодействию экстремизму среди молодежи, на пост главы которого прочат Аветисова, в УОП пока не существует, а само направление курирует первый заместитель руководителя администрации президента Сергей Кириенко. \r\nИсточники «Коммерсанта» утверждают, что Аветисову планируется поручить курирование молодежных субкультур и вопросов декриминализации молодежной среды — например, решением проблемы популярности АУЕ («арестантский уклад един»). \r\nАветисов одним из немногих постоянно обсуждал в Общественной палате тему волонтерства в чрезвычайных ситуациях, рассказала руководитель движения «Волонтеры победы», член ОП Ольга Амельченкова. \r\nВторой предполагаемый назначенец — Ксения Разуваева — до того как возглавить Роспатриотцентр в 2014 году, возглавляла московское отделение Союза добровольцев России и сотрудничала с «Молодой гвардией Единой России» (МГЕР). \r\n*** \r\nА вот что удалось раскопать на Аветисова Алексея Сергеевича http://polit.ru/news/2018/07/11/avetisov/ \r\nсудите сами!\n			<br>Date: \n			<br>Booking Location: Central Flagship\n			<br>Booking Time Option 1: \n			<br>Booking Time Option 2: ', 'info@xtremelashes.com.hk', '2019-01-09 15:00:54', '2019-01-09 15:00:54', '1', '', 'english'),
