(106, 'Appointment request from ArthurDiaky', '<b>Appointment details:</b>\n			<br>Name: ArthurDiaky\n			<br>Phone: \n			<br>Email: 123teatr@gmail.com\n			<br>Message: http://kamozin.com/storage/album/1/s/u/b1297270ac4ea039d5424a2.jpg \r\n \r\nЯзык цветов \r\nПредставьте ситуацию: мужчина дарит девушке красивый букет цветов, а она, внимательно посмотрев на него, почему-то обиделась. Дело в языке цветов – флористы называют его флюрографикой. Просто девушка сразу обратила внимание на оттенок цветов, пересчитала количество бутонов и поняла композицию по-своему. \r\n \r\nМногие мужчины, при выборе букета, не задумываются о том, сколько бутонов должно быть в нем. А девушки, которые увлекаются флюрографикой, хорошо знают, что обозначает букет из семи роз или пяти гербер. Скорее всего, девушка не будет считать количество бутонов отдельно каждого сорта в сложной многовидовой композиции, но если мужчина выбрал один определенный цветок для букета, то к количеству он должен подойти ответственно. В современной флористике принята следующая расшифровка: один цветок – «ты единственная», пять и семь – признание в любви, девять бутонов символизируют уважение, а 11 говорят, что девушка для мужчины – лучший друг. Это правило справедливо для всех видов цветов. \r\n \r\nЧасто мужчины не ограничиваются композицией из 11 цветов, предпочитая преподнести девушке огромный букет. Это правильно: чем больше цветов подарено, тем сильнее мужчина желает оставить хорошее впечатление о себе. Ведь никому не придет в голову дарить дорогие огромные букеты своим коллегам по учебе или работе или просто подругам. Однако, покупая большую композицию, проследите, чтобы число бутонов в ней было обязательно нечетным, ведь «четные» букеты предназначены совсем для других мероприятий. \r\n \r\nРасцветка является не менее важным параметром при выборе букета. Белые цветы уместны как подарок на важную торжественную дату, будь то день рождения или окончание учебы, желтые чаще всего дарят подругам и коллегам по работе