(824, 'Appointment request from Michelle Jones', '<b>Appointment details:</b>\n			<br>Name: Michelle Jones\n			<br>Phone: +85251234567\n			<br>Email: dontcontactme@gmail.com\n			<br>Message: I just got off a phone call with one of your staff assuming I am Asian without asking, it is very unprofessional and racist honestly especially when she was telling me how my accent sounded like. I have a british  accent and grew up overseas, it is very unprofessional for people to “tell” a race over a simple phone call. There are plenty of accents around the world, I suggest your staffs to be careful with answer like this. And should ask “may I know where you are from? As we suggest different volume, curve and width for different type of eyes” instead of “you are Asian” \n			<br>Date: 2020-11-17\n			<br>Booking Location: Central Flagship\n			<br>Booking Time Option 1: 06:00 PM\n			<br>Booking Time Option 2: 05:00 PM', 'info@xtremelashes.com.hk', '2020-11-17 07:46:22', '2020-11-17 07:46:22', '1', '', 'english'),
