(10, 'gallery', 'Gallery | Xtreme Lashes HK', 'Xtreme Lashes Hong Kong - Gallery', '<meta name=\"description\" content=\"Browse through Xtreme Lashes HK gallery & see before & after images of our eyelash extension service. You will be inspired to get one for yourself too!\"/>\n<meta name=\"robots\" content=\"noodp\"/>\n<link rel=\"alternate\" href=\"{site_url}gallery/\" hreflang=\"en-hk\" />\n<link rel=\"alternate\" href=\"{site_url}cn/gallery/\" hreflang=\"zh-hk\" />\n<link rel=\"canonical\" href=\"{site_url}gallery/\" />\n<meta property=\"og:locale\" content=\"en_US\" />\n<meta property=\"og:type\" content=\"article\" />\n<meta property=\"og:title\" content=\"Xtreme Lashes Hong Kong - Gallery\" />\n<meta property=\"og:description\" content=\"See beautiful models try on our products in our extensive gallery!\" />\n<meta property=\"og:url\" content=\"{site_url}gallery/\" />\n<meta property=\"og:site_name\" content=\"Xtreme Lashes Hong Kong\" />\n<meta name=\"twitter:card\" content=\"summary\" />\n<meta name=\"twitter:description\" content=\"See beautiful models try on our products in our extensive gallery!\" />\n<meta name=\"twitter:title\" content=\"Xtreme Lashes Hong Kong - Gallery\" />', '', 'gallery/', 'gallery'),
