(12, 'lash_lift', 'Lash Lift - Xtreme Lashes Hong Kong', 'Lash Lift - Xtreme Lashes Hong Kong', '\r\n<link rel=\"canonical\" href=\"{site_url}lash-lift/\" />\r\n<link rel=\"alternate\" href=\"{site_url}lash-lift/\" hreflang=\"en-hk\" />\r\n<link rel=\"alternate\" href=\"{site_url}cn/lash-lift/\" hreflang=\"zh-hk\" />\r\n<meta property=\"og:locale\" content=\"en_US\" />\r\n<meta property=\"og:type\" content=\"article\" />\r\n<meta property=\"og:title\" content=\"Lash Lift - Xtreme Lashes Hong Kong\" />\r\n<meta property=\"og:description\" content=\"I. Conditions of Training Program Purchase and/or AttendanceIt is the policy of Xtreme Lashes, LLC (hereafter referred to as the...\" />\r\n<meta property=\"og:url\" content=\"{site_url}lash-lift/\" />\r\n<meta property=\"og:site_name\" content=\"Xtreme Lashes Hong Kong\" />\r\n<meta name=\"twitter:card\" content=\"summary\" />\r\n<meta name=\"twitter:description\" content=\"I. Conditions of Training Program Purchase and/or AttendanceIt is the policy of Xtreme Lashes, LLC (hereafter referred to as the...\" />\r\n<meta name=\"twitter:title\" content=\"Lash Lift - Xtreme Lashes Hong Kong\" />', '', 'lash-lift/', 'lash_lift');
INSERT INTO `page_content` (`id`, `page_id`, `content_key`, `content_title`, `content_value`, `content_value_cn`, `content_order`) VALUES
(1, 1, 'result_you_love', 'Results you love', 'The first thing you&rsquo;ll notice about your eyelash extensions when you look in a mirror, is that your eyelashes are longer, thicker, darker and more voluminous; you&rsquo;ll be amazed by just how real they seem! Our eyelash extensions are flexible yet crimp-resistant, and you&rsquo;re still able to see your eye line, which adds to their natural eect. Not only that, they move with your natural lashes too.', '植睫最明顯的效果一定是在照鏡時，你會發現自己的睫毛變得捲翹纖長、如娃娃般濃密，你應該想像不到植上的睫毛竟然會如此真實自然！我們的人工睫毛既柔韌又防皺，令嫁接更貼服，獨特的合成纖維很柔軟，嫁接後效果非常自然！', 2),
(2, 1, 'content_below_slider', 'Content below slider', 'Xtreme Lashes&reg; eyelash extensions have adorned famous eyes on red carpets around the world. They have been featured at the Golden Globes, the Cannes Film Festival and the Academy Awards, as well as in publications such as Vogue, InStyle and Allure', '不少世界各地走紅地氈的明星/藝人都會選用Xtreme Lashes，例如出席金球獎、康城影展、奧斯卡金像獎等盛事的藝人，或者在知名雜誌Vogue、Instyle、Allure等見到的模特兒都經常選用Xtreme Lashes。', 1),
(4, 1, 'academy_training', 'Academy Training', '<p class=\"block2pa d-block\">Start or grow your business and learn the latest techniques by enrolling in one of our hands-on eyelash extensions Training and Certification Programs.<br /><br />We offer multiple training program options for both experienced and non-experienced Lash Stylists.</p>', '<p class=\"block2pa d-block\">報讀由Xtreme Lashes導師指導的美睫證書課程，學習最新的植睫技巧。無論你是剛開始或者正在擴展你的美睫事業，Xtreme Lashes HK都提供不同的培訓課程，給有經驗的美睫師或新手美睫師選擇。</p>', 3),
(6, 2, 'phone', 'Phone', '<p>(+852) 3708-8961</p>', '', 1),
(7, 2, 'email', 'Email', 'booking@xtremelashes.com.hk', '', 2),
(9, 2, 'address', 'Address', '3/F, V-Plus 68-70 Wellington Street Central Hong Kong', '香港中環威靈頓街68-70號V Plus大廈3樓', 3),
(10, 3, 'why_xtreme_lashes', 'Why Xtreme Lashes Section', '<p>We are now has over 20,000 trained stylists across 50 countries worldwide and our flagship store in Hong Kong launches in Central, Hong Kong in this coming December 2015.</p>\n<br /> With Xtreme Lashes Eyelash Extensions you can look and feel gorgeous from the moment you wake up until the moment you fall asleep with little to no effort.<br /><br /> The luxurious natural look of Xtreme Lashes&reg; Eyelash Extensions is achieved by a meticulous and artful application of synthetic lashes, all applied one by one to your natural lash by a certified Xtreme Lashes&reg; Lash Stylist.<br /><br /> With Xtreme Lashes&rsquo; diverse inventory of over 950 individual styles of eyelash extensions, you and your stylist can design a tailored look to compliment your natural beauty.<br /><br /> During the application of Xtreme Lashes Eyelash Extensions, your stylist will isolate an individual natural lash, then; he/she will expertly bond one eyelash extension to one natural lash to create a SEAMLESS look. &ldquo;When we say Seamless, is seamless.&rdquo;', '我們現時在全球40多個國家共有超過20,000個註冊美睫師，而位於香港中環的旗艦店亦在2015年12月正式營業。<br /> Xtreme Lashes&reg;的植睫療程讓你從起床那一刻到睡覺那一刻，不費吹灰之力都可以擁有亮麗的外表，即使不化妝亦都一樣美麗動人。<br /> Xtreme Lashes&reg;的植睫技術是一絲不苟的，由Xtreme Lashes&reg;註冊美睫師會以專業的技術，為你的自然睫毛逐一植上人工睫毛。<br /> Xtreme Lashes&reg;有提供超過950種款獨特的睫毛，你可以與你的美睫師一起設計出最適合自己的睫毛造型，來配搭出最自然的外表。<br /> 在Xtreme Lashes&reg;的植睫療程中，你的睫毛師會仔細分離每一條自然睫毛，再以專業的技術，將人工睫毛逐條嫁接種植在每一條自然睫毛上，為你締造無縫的睫毛造型。<br /> 我們所說的無縫正正是植睫無縫。<br /> 我們的植睫技術可說是天衣無縫。零瑕疵、無駁口<br /> 無縫、零瑕疵、零駁口正是Xtreme Lashes完美植睫技術。', 1),
(11, 3, 'our_mission', 'Our Mission Section 1', 'Enriching and empowering lives by delivering on our promise<br /> to provide revolutionary beauty products, unparalleled client<br /> support, and comprehensive education.<br /><br />', 'Xtreme Lashes承諾會提供最優質的美容產品及客戶服務，<br />並為美睫師提供全面的培訓，<br />讓她們的生活變得更圓滿充實。<br /><br />', 2),
(12, 3, 'our_mission_2', 'Our Mission Section 2', '<h2 style=\"font-size: 15px;\"><strong>OUR VISION</strong></h2>\n<br /> To be the revolutionary cosmetic brand: globally recognized and exclusively offered by the world&rsquo;s leading beauty professionals.<br /><br />\n<h2 style=\"font-size: 15px;\"><strong>OUR VALUES</strong></h2>\n<br /> Empower and inspire everyone we encounter. Pour passion into everything we do. Our pursuit of excellence is driven by the support and collaboration of our clients and employees. Never stop learning. Never stop growing. Never quit. The outcome is up to each of us and we want it that way. Practice honesty and integrity in everything. Demonstrate courage and honor at all times. Liberate your individuality. Embrace your creativity. Celebrate your success. Create the standards of excellence for products, services, and education. Embrace innovation and quality control to stand above the rest. Because we care.', '<strong>我們的目標</strong><br /> 成為革命性的植睫化妝品牌︰讓Xtreme Lashes的獨家植睫服務遍佈全球，成為國際認可的專業品牌<br /><br /> <strong>我們的價值</strong><br /> 希望我們遇上的每一個顧客都能啟發自信和展現魅力。 我們處理每件事情都能全情投入、充滿熱情 我們追求的卓越優質服務是需要客戶的支持和團隊的合作來推動的。持之以恆、堅持終身學習、自我增值、絕不輕言放棄。成果是在乎我們努力的過程。/一分耕耘，一分收穫。我們會以真誠和正直的態度處事無論什麼時候都勇於嘗試，積極勇敢地面對。尊重自己的個性及創意，並為成功感到喜悅和驕傲。創造最優質的產品、服務及教肓。產品的創新和品質監控比一切重要。我們關心你的需要。', 3),
(13, 3, 'about_founder_1', 'About Founder Section 1', 'Jo Mousselli, Co-Founder, President &amp; CEO of Xtreme Lashes by Jo Mousselli&reg;, never imagined that she would one day lead a global cosmetic company.<br /><br /> Jo immigrated to the United States as a child, believing in her father&rsquo;s mantra that &ldquo;with education, hard work, and perseverance, you can accomplish anything.&rdquo;<br /><br />\n<h2 style=\"font-size: 15px;\"><strong>ENTREPRENEUR</strong></h2>\n<br /> Jo has seen her company expand from a home-based, family business into a global corporation with representation in 40 countries. Xtreme Lashes by Jo Mousselli currently has 20 educators across the United States and continues to experience explosive growth across the globe. Since 2005, the company has trained more than 15,000 health and beauty professionals worldwide.<br /><br />\n<h2 style=\"font-size: 15px;\"><strong>EXPERT</strong></h2>\n<br /> Using a holistic approach and the scientific method, Jo formulated a safe and hygienic process for applying eyelash extensions to natural lashes. She also produced comprehensive educational programs, created innovative cosmetic products, and offered unparalleled support for beauty and health professionals.<br /><br /> Jo wanted to teach stylists a service they could add to their current beauty salon menu or use to develop their own independent business. She also set out to empower the lives of consumers who used quality eyelash extensions by Xtreme Lashes by Jo Mousselli to feel effortlessly beautiful every day.', 'Xtreme Lashes&reg;創辦人、總監及行政總裁Jo Mousselli從來沒想過，有一天她能將這個品牌引入全球市場，甚至成為行業的龍頭。<br /><br />Jo Mousselli自小移民到美國，一直堅信父親的座右銘︰「學習、努力、和堅持能讓助你實現任何目標。」<br /><br /> <strong>企業家</strong><br /> Jo Mousselli將Xtreme Lashes從一間小型的家庭生意發展成一間全球企業，代理公司遍及40多個國家。Xtreme Lashes&reg;現時有20名導師駐守美國，致力將業務擴展至全球。自2005年至今，Xtreme Lashes已經在全球各地培訓出超過20,000名註冊美睫師。<br /><br /> <strong>專家</strong><br /> Jo Mousselli進行全面的科學研究，設計出一套安全而衛生的植睫技術，並建立完善的培訓課程，發展新的美容產品，為美睫師提供無限的支援。 <br /><br /> Jo Mousselli希望教授植睫技術予美容師，讓她們的美容室能加設植睫服務，或者發展自己的美睫事業。她亦希望為植睫的顧客增添自信，讓她們不費吹灰之力都可以每日享受美顏。', 4),
(14, 3, 'about_founder_2', 'About Founder Section 2', '<h2 style=\"font-size: 15px;\"><strong>CAREGIVER</strong></h2>\n<br /> Jo graduated magna cum laude from Texas Woman&rsquo;s University with a Bachelors of Science in Nursing and minor in Biology. She has extensive medical and scientific experience in human anatomy, physiology, pathology and pharmacology. After a decade working as a pediatric ICU nurse at Texas Children&rsquo;s Hospital, Jo felt compelled to pursue her passion in the beauty industry. Jo applied her medical and scientific knowledge to developing the products, application tools, and training that is the core of the brand.<br /><br /> Jo knows women. From being a wife, an active mother of four, and putting herself through work and school, Jo understands the modern woman.<br /><br /> Jo&rsquo;s nurturing nature has made it easy for her to connect with women, from her first career as a kindergarten teacher &ndash; garnering the trust of mothers and their children&rsquo;s first day of school &ndash; to consoling mothers, whose critically ill children were under her care as a registered nurse. She has always been in the &ldquo;business&rdquo; of helping women feel better.<br /><br />\n<h2 style=\"font-size: 15px;\"><strong>PIONEER</strong></h2>\n<br /> Jo&rsquo;s attributes and values have made Xtreme Lashes by Jo Mousselli the worldwide industry leader and the most respected name in eyelash extensions. Jo made the art of eyelash extension application a professional service, limiting sales exclusively to licensed and credentialed health and beauty professionals.<br /><br /> She risked her short-term profits and invested in the long-term health of the company and lash industry by initiating mandatory hands-on training and education for every licensed health and beauty professional wanting to become a lash stylist.<br /><br />\n<h2 style=\"font-size: 15px;\"><strong>LEADER</strong></h2>\n<br /> She took the path less traveled, one of service and sacrifice. Her hard work and dedication have paid o by allowing her to arrive at her destiny of empowering other women to experience the success and blessings that life has given her. In turn, she created an industry of passionate entrepreneurs with a zest for inner and outer beauty and the success of a rewarding and profitable career.<br /><br /> Among numerous awards, she was named a Gulf Coast Area Finalist for the 2011 Ernst &amp; Young Entrepreneur of the Year award and earned a spot on the coveted 2011 Inc. 500|5000 List.', '<strong>關愛者</strong><br /> Jo Mousselli於德州女子大學以極優等榮譽學位畢業，主修護理學學士及副修生物學，對於人體解剖學、生理學、病理學、藥物學均有豐富的醫學及科學知識。在德州兒童醫院的兒科加護病房做了10年護士之後，她毅然投身美容事業。Jo Mousselli希望將她的所學到的醫學及科學知識，應用在產品工具的研發及培訓上，亦是品牌的核心價值所在。<br /><br /> Jo Mousselli非常了解女性，作為一個妻子和四個孩子的母親，加上她在學校和醫院工作的經驗，她非常明白現代女性的心理。<br /><br /> Jo Mousselli用心照顧別人的特質讓她更理解女性，從她第一份幼稚園教師的工作開始，就要在孩子們第一個上學日得到母親們的信任﹔而在醫院工作，她要以護士的身份去照顧患重病的孩子及安慰他們的母親，因此她的使命是要讓女士們都感到安心。<br /><br /> <strong>先鋒</strong><br /> Jo Mousselli的付出和努力令讓Xtreme Lashes&reg;成為享譽全球且廣為人知的植睫品牌，她將植睫藝術發展成專業服務，只向信譽良好的註冊美睫師銷售指定的產品，保持良好的服務質素。<br /><br /> 為了公司和美睫事業的長遠發展，Jo Mousselli寧願犧牲短期利益，都要以導師指導的教學模式，為想成為註冊美睫師的美容師進行培訓。<br /><br /> <strong>領導者</strong><br /> Jo Mousselli選擇了一條充滿未知之數的路，一直盡力為他人犧牲和服務。她付出的努力和信念，是希望能將人生帶給她的喜悅和祝福分享予其他女性，讓她們得到更多的力量和自信。她對內在美及外在美的追求，為想投身美睫事業的美容師建立基石，讓她們發展自己的事業，取得可觀的回報和成果。<br /><br /> 在獲得的多個獎項中，她在2011年被提名入圍安永年度企業家獎，並在知名的2011 Inc. 500|5000 List榜上有名。', 5),
(15, 4, 'classic_lashes', 'Classic Lashes', 'Xtreme Lashes&reg; Eyelash Extensions were developed to mimic your natural lashes; their design features a tapered tip with a thicker base to resemble the look and feel of a natural lash. The luxurious natural look of Xtreme Lashes Eyelash Extensions is achieved by a meticulous and artful application of synthetic lashes, all applied one by one to each individual natural lash by a certified Xtreme Lashes Lash Stylist.<br /><br />\n<h2 style=\"font-size: 1rem;\"><strong>FULL XTREME SET</strong></h2>\n<br /> This full set of classic lashes completes your look with a voluminous set of professionally applied single layer lashes customized to your eyes with various length, thickness, curvature and color to make your eyes shine! A full set is approximately 70-100 lashes per eye and it may take from 90-120 minutes.', 'Xtreme Lashes&reg;人工睫毛是仿照你的自然睫毛而製的，其設計特點是以錐形的尖端配合闊底，令人工睫毛與自然睫毛看起來感覺更相似。Xtreme Lashes&reg; 植睫療程採用一絲不苟及且完善的植睫技術，由Xtreme Lashes&reg;註冊美睫師為你的自然睫毛逐一嫁接人工睫毛。<br /><br /> <strong>完整植睫療程 </strong><br /> 傳統植睫療程會在你的自然睫毛上嫁接單一人工睫毛，每隻眼睛大約可以嫁接70-100條睫毛（*視乎個別情況），人工睫毛的長度、厚度、弧度及顏色可以因應你的睫毛調節，為你打造濃密自然的睫毛', 1),
(16, 4, 'volumation_eyelash', 'Volumation Eyelash', 'Volumation &trade; is a lash application technique using multiple eyelash extensions to a single natural eyelash in order to create depth, volume and texture to the natural lashes. In order to maintain the integrity and health of the natural lashes, your Lash Stylist uses the Xtreme Lash Calculator to determine the safe amount of extensions that can be applied to a single lash. While traditional extensions involve applying just one extension per natural lash, Volumation &trade; extensions are thinner, making them virtually weightless, allowing anywhere from two to eight extensions to be applied to one natural lash at a time, giving you a fuller lash line. Volumation &trade; is appropriate for all extension wearers, but is especially beneficial to clients with a sparse lash line since a fuller look can be achieved even if there are fewer natural lashes.', 'Volumation&trade;是一種美睫師將2-8條的睫毛嫁接在單一自然睫毛上的嫁接技術，令自然睫毛變得更有深度、密度和質感。為了令睫毛保持捲翹和健康，你的美睫師會使用睫毛條數計算工具，來計算可以嫁接睫毛排毛最安全數量。傳統植睫是將人工睫毛逐一嫁接在單一自然睫毛上，Volumation&trade;所採用的睫毛更幼細，近乎無重量，又可以製造更濃密的眼線。Volumation&trade;適合任何能進行植睫的客人，特別是眼線較稀疏的客人，即使睫毛數量不多，都能締造濃密的效果。', 2),
(17, 4, 'bridal_section_1', 'Bridal Section 1', 'While eyelash extensions have been increasingly popular among brides-to-be everywhere, it&rsquo;s important to get extensions that are safe and durable. You don&rsquo;t want to show up to your big day with nasty infections or eyelashes that have been twisted around in unnatural looking ways! As a bride, you&rsquo;ll want something reliable since it is, after all, the most important day of your life.&nbsp;You can be sure that our certified lash stylists will give you an eyelash extension service that&rsquo;s trustworthy and long-lasting.<br /><br /> Our Xtreme Lashes Bridal package includes one time of full set of eye lashes extension and one time of relash. Schedule your lash appointment 2 weeks before the wedding, then 1 to 2 days before the wedding to receive a lash fill.', '想做植睫的準新娘越來越多，選擇安全且持久的植睫服務非常重要。在結婚這個大日子，你也不想你的眼睛受到感染，或者睫毛變得雜亂吧！所以找信譽良好的植睫品牌非常重要。<br /><br /> Xtreme Lashes&reg;新娘植睫優惠包括一套完整的植睫療程和一次睫毛修補療程。你只需在婚禮前2星期預約植睫服務，然後在婚禮前數天做一次睫毛修補療程，那就萬無一失啦！', 3),
(18, 4, 'bridal_section_2', 'Bridal Section 2', '<strong>5 REASONS EYELASH EXTENSIONS ARE INDISPENSABLE ADDITIONS FOR BUSY BRIDES:</strong><br /><br /> 1. Save Time (Pre-wedding):<br /> Wedding preparation is hectic! There&rsquo;s so much to accomplish and there never seems to be enough time for the bride to get to everything. Eyelash extensions are a great time saver! Brides can skip the morning makeup routine and make it to all their errands that much faster all while still looking fabulous!<br /><br /> 2. Save Face (Pre-wedding):<br /> Stress and lack of sleep plague many a bride-to-be during the weeks leading up to the wedding. Eyelash extensions can create a well-rested, wide-eyed appearance and help disguise any signs of stress or sleep deprivation that often show on the face.<br /><br /> 3. Stay Fresh (Day of):<br /> The actual wedding day is typically quite long for brides. Preparations begin early in the morning and celebrations last late into the night. With eyelash extensions, brides are photo-ready throughout the entire day with no need to stop for cosmetic touch-ups!<br /><br /> 4. Stay Flawless (Day of):<br /> There&rsquo;s nothing worse than a beautiful bride sporting raccoon circles of mascara around her eyes. Since just about every bride tears up at her wedding, eyelash extensions are the ideal solution to prevent any mascara mishaps!<br /><br /> 5. Set Sail (Post-wedding): <br /> Starting out a wedding in eyelash extensions extends into the honeymoon. For brides planning any post-wedding trips, eyelash extensions are the perfect travel companion. New wives can enjoy all the extracurricular activities at their exotic destination of choice with no fuss &amp; no muss and still look absolutely fabulous!<br /> GET TOGETHER! BRIDAL SHOWER PARTY<br /><br />', '<strong>植睫對於忙碌的新娘來說是不可缺少的 </strong><br /><br /> 1) 節省時間(婚禮前)<br /> 婚禮前的準備工夫十分繁瑣，想做的事情太多，新娘不會有足夠的時間去完成所有事情。植睫絕對能為新娘節省時間，新娘可以省卻早上化妝的時間，去做其他事情，就算怎樣忙都能保持亮麗的外表啦！<br /><br /> 2) 遮蓋瑕疵(婚禮前)<br /> 在婚禮前的幾個星期，壓力和睡眠不足都會令很多準新娘感到困擾，植睫能讓她們看起來雙目有神，並掩蓋了臉上其他因壓力或睡眠不足而出現的痕跡。<br /><br /> 3) 精力充沛(婚禮當天)<br /> 婚禮當天對新娘來說都是非常漫長的，一大清早就要開始準備，然後要撐足一整天。新娘植上睫毛後，就不用頻頖補妝，娼禮當日隨時都可以拍照啦！<br /><br />4) 完美無暇(婚禮當天)<br /> 使用睫毛液很容易會現暈染，但是新娘們往往都很容易掉眼淚，所以植睫可以說是預防暈染和污垢出現的最佳方法。<br /><br /> 5) 蜜月啟航(婚禮後) <br /> 除了婚禮，渡蜜月都少不了要植睫。對於想去蜜月旅行的新娘們來說，植睫睫毛絕對是你的完美旅行伴侶。新婚女孩可以在異國盡情玩樂之餘，都能保持亮麗的外表。<br />在告別單身之前約定你的姊妹一起來植睫吧！<br /><br />', 4),
(19, 4, 'video', 'Video Link', 'https://www.youtube.com/embed/eIRPbLxd-U8', '', 5),
(20, 4, 'reviews_section_1', 'Reviews Section 1', '<p class=\"testimonial\">&ldquo;You don&rsquo;t feel them or notice them &ndash; they just feel like part of your normal lashes.&rdquo;<br /> <strong>- AMANDA BL.</strong></p>\n<p class=\"testimonial\">&ldquo;Having eyelash extensions really lifts your self-esteem. If I&rsquo;m having a bad hair day, or my skin looks dull and lacklustre, just knowing I have the lashes on makes me feel so much better.&rdquo;<br /> <strong>- JANE K.</strong></p>\n<p class=\"testimonial\">&ldquo;There is nothing more satisfying than not having to remove mascara from your eyelashes every night!&rdquo;<br /> <strong>- RACHEL E.</strong></p>\n<p class=\"testimonial\">&ldquo;Definitely the best eye lashes extension shop in Hong Kong. The therapists are very professional and well-trained. They all have patience to answer all your questions and they all giving you honest advices.<br /><br /> The eye lashes are in very good quality and look natural. I have been having my eye lashes for around 6 weeks now and I guess it will last for another 2 weeks.<br /><br /> Definitely worth the price and the service is extremely good.&rdquo;<br /> <strong>- YANYAN KARIN WU</strong></p>', '<p class=\"testimonial\">你不會Feel到或者睇到啲植睫毛，它們就好似係你自然睫毛的一部分！<br /> <strong>- AMANDA BL.</strong></p>\n<p class=\"testimonial\">植睫真係可以提升你的自信，就算我果日髮型好亂、皮膚睇起嚟暗淡無光，但是只要植上睫毛都會令我心情變好！<br /> <strong>- JANE K.</strong></p>\n<p class=\"testimonial\">最開心嘅莫過於係唔洗每晚都要卸睫毛膏，同埋唔洗去到中午就變左熊貓眼啦！<br /> <strong>- RACHEL E.</strong></p>\n<p class=\"testimonial\">(Xtreme Lashes)絕對係全香港最好的植睫店，美睫師表現非常專業，技巧非常熟練，她們會很有耐性地解答你所有的疑問，以及給你最誠實的建議。睫毛質素佳，效果非常自然。我上次植睫距離現在差不多6個星期，應該可以要維持2個星期左右，價錢絕對合理，服務素質一流！ <br /><strong>- YANYAN KARIN WU</strong></p>', 6),
(21, 4, 'reviews_section_2', 'Reviews Section 2', '&ldquo;Lash technicians are very professional and friendly. Their artisanal technique cutosmises a stye of lashes that suits my face shape and lifestyle .<br /> Xtreme lashes offers high quality and vast variety of lash choices. The environment is very comfortable and hygienic.&rdquo;<br /> <strong>- GENEVIEVE L.</strong>\n<p class=\"testimonial\">&ldquo;Had a five star experience at Extreme Lashes. Professional staff and friendly service. The consultant really took the time to explain their services and I\'m impressed with the extensive menu of lash styles as well as the quality of my lashes.&rdquo;<br /> <strong>- GIGI TANG</strong></p>\n<p class=\"testimonial\">&ldquo;I have been visiting xtremelashes for more than a year now, therapists are professional and attentive, lashes are with good quality, and most importantly my extensions can usually keep for a month (or more) and my natural lashes have not fallen out! I have been recommending to my friends and they are very satisfied with the results too!&rdquo;<br /> <strong>- EUGENIE CHIU</strong></p>\n<p class=\"testimonial\">&ldquo;Very professional service carried out by the hk team. Great customer experience ! I feel so comfortable.&rdquo;<br /> <strong>- HEATHER PAPOUTSIS</strong></p>', '美睫師都非常專業且態度親切，她們熟練的技術，可以設計出適合我面型和生活作息的睫毛造型。Xtreme Lashes亦提供大量高質素的睫毛款式，而且環境非常舒適衛生。<br /> <strong>- GENEVIEVE L.</strong>\n<p class=\"testimonial\">我在Xtreme Lashes享受到五星級的體驗，專業的員工和親切的服務態度，美睫師真係會花時間向你解釋植睫的流程。最讓我驚訝的是，她們有各種各樣的睫毛款式，我也非常喜歡她們為我植上的睫毛。<br /> <strong>- GIGI TANG</strong></p>\n<p class=\"testimonial\">我來Xtreme Lashes植睫已經接近一年多，美睫師都非常專業和專注，睫毛的素質極佳，最重要的是我的睫毛都可以維持到一個月（或以上），而我的自然睫毛都不會脫落。我推薦左比其他朋友，她們都非常滿意Xtreme Lashes的植睫服務！<br /> <strong>- EUGENIE CHIU</strong></p>\n<p class=\"testimonial\">非常專業的服務，優質的客戶體驗，讓我感到非常舒適！<br /> <strong>- HEATHER PAPOUTSIS</strong></p>', 7),
(27, 5, 'training_section', 'Training Section', '<ol class=\"step-num\">\n<li class=\"tstep-li\">\n<h2 style=\"font-size: 15px;\">LASH STYLIST FUNDAMENTALS &amp; CERTIFICATION PROGRAM (FLEX TRACK)</h2>\n<ul class=\"tstep-ul \">\n<ul class=\"tstep-ul \">\n<li>\n<p class=\"tsteps-text\">This option includes the Level 1 Training Program which is designed to provide fundamental and comprehensive eyelash extension training on how to apply eyelash extensions using our proprietary products and techniques plus essential business development training.</p>\n</li>\n<li>\n<p class=\"tsteps-text\">Note that the current Xtreme Lashes&reg; Advanced Artistic level program is available in English and Chinese.</p>\n</li>\n</ul>\n</ul>\n<a href=\"contact_us\"><button class=\"btn btna btn-outline-black\" style=\"margin-top: 0 !important;\">BOOK NOW</button></a></li>\n<li class=\"tstep-li\">\n<h2 style=\"font-size: 15px;\">LASH STYLIST FUNDAMENTALS &amp; CERTIFICATION PROGRAM (FAST TRACK)</h2>\n<ul class=\"tstep-ul \">\n<ul class=\"tstep-ul \">\n<li>\n<p class=\"tsteps-text\">Successful completion of this lash extension training program enables you to get trained, earn Certification, and get listed on the Xtreme Lashes Lash Stylist Directory in only 4 days!</p>\n</li>\n</ul>\n</ul>\n<a href=\"contact_us\"><button class=\"btn btna btn-outline-black\" style=\"margin-top: 0 !important;\">BOOK NOW</button></a></li>\n<li class=\"tstep-li\">\n<h2 style=\"font-size: 15px;\">EXPERIENCED LASH STYLIST PROGRAM</h2>\n<ul class=\"tstep-ul\">\n<ul class=\"tstep-ul\">\n<li>\n<p class=\"tsteps-text\">This unique &ldquo;Convert to Xtreme Lashes&rdquo; program offers experienced eyelash extension professionals, trained by an acknowledged eyelash extension company, the opportunity to become an Xtreme Lashes&reg; Lash Stylist, purchase Xtreme Lashes products, earn Xtreme Lashes Certification, and get listed on the Xtreme Lashes Lash Stylist Directory&trade;.</p>\n</li>\n</ul>\n</ul>\n<a href=\"contact_us\"><button class=\"btn btna btn-outline-black\" style=\"margin-top: 0 !important;\">BOOK NOW</button></a></li>\n</ol>', '<p class=\"Asec2-text\">修讀條件 <br />任何想成為Xtreme Lashes&reg;美睫師，或想加盟Xtreme Lashes植睫品牌的美容同業，都歡迎報讀我們的美容師培訓課程 <br /><br /> 簡介 Xtreme Lashes&reg;植睫培訓及證書課程為你提供︰ 4日全期培訓及證書課程，內容涵括所有獨立課程的知識及技巧，學員可獲學生工具套裝及入門工具包各乙份，這個配套包含所有畢業學生創業所需的一切工具，包括產品、市場推廣資料、事先預備好的試用裝陳列品。另外，學員可以獲得6星期2小時的獨立培訓，助你首先成為一位美睫師學徒，繼而踏上專業美睫師之路。 <br /><br /> 課程內容 植睫培訓獨立課程* <br /><br /> 植睫初階體驗課程︰介紹植睫、工具及產品的基礎知識，利用紙張及模型體驗植睫，學員可獲學生工具套裝乙份 <br /><br /> 植睫進階學習課程︰介紹植睫、工具及產品的應用知識，學習提取、分離及嫁接睫毛，介紹修補睫毛療程，認識Xtreme Lashes Faux Mink Bold和X-Wrap睫毛，體驗為真人模特兒植睫，學員可獲學生工具套裝乙份 <br /><br /> 植睫高階進修課程︰為真人模特兒植睫，讓學員熟習植睫的技巧，講解修補睫毛的步驟及技巧，並介紹不同眼形的基本概念，講解如何利用Xtreme Lashes Faux Mink Bold和X-Wrap睫毛設計睫毛造型，來配襯不同的眼形和睫毛類型，以及其他銷售技巧及知識，學員可獲學生工具套裝乙份 <br /><br /> 植睫高階證書課程（註冊美睫師考核認證）︰學習修補睫毛的高階技巧，為真人模特兒進行植睫練習及考核，通過考核的學員可以取得Xtreme Lashes美睫師牌照，學員可獲入門工具套裝乙份 <br /><br /> *學員可以自選報讀課程的日數，唯此植睫毛課程不設插班制，學員必須完成初階課程，方可報讀進階課程，如此類推，想考取美睫師牌照的學員必須完成一連四日之課程（具經驗的美睫師可申請豁免第一日之課程）</p>', 1),
(30, 5, 'video_training', 'Video Link', 'https://www.youtube.com/embed/8CPcH5mLKF0', '', 4),
(31, 5, 'signup', 'Sign Up Section', 'Did you know that offering Xtreme Lashes Eyelash Extensions is one<br /> of the most lucrative beauty services you can offer at your salon? With<br /> demand for eyelash extensions growing quickly, now is the time<br /> to sign up and become a Certified Lash Stylist.', '植睫服務越來越受歡迎，所以在美容室提供Xtreme Lashes植睫服務絕對是明智之舉，<br /> Xtreme Lashes的香港植睫毛課程向來是美容課程類別的熱門之選，快點來報讀我們的植眼睫毛培訓課程，成為註冊美睫師啦！', 5),
(32, 6, 'procedure', 'EYELASH EXTENSION PROCEDURE', 'Prior to the application, your stylist will conduct a thorough consultation allowing you the opportunity to help design your customized lash look. In addition, your stylist may ask questions about your health and lifestyle to ensure Xtreme Lashes&reg; Eyelash Extensions are right for you.<br /><br /> During your Xtreme Lashes&reg; Eyelash Extension application, you will comfortably recline with your eyes closed. The application of Xtreme Lashes&reg; Eyelash Extensions is painless and wonderfully relaxing and rejuvenating. Clients typically fall asleep then awaken to longer, thicker, darker and more voluminous lashes.<br /><br /> To ensure your safety during and after the procedure, eyelash extensions are never applied to your skin; Xtreme Lashes&reg; Eyelash Extensions are attached only to your natural lashes.<br /><br /> Additionally, Xtreme Lashes&reg; Eyelash Extensions are adhered to your natural lash using our safe and proprietary line of Xtreme Lashes&reg; Adhesives.', '在進行療程前，你的美睫師會跟你進行全面的諮詢，讓你可以與美睫師一起設計出最適合自己的睫毛造型。此外，美睫師亦會問你一些有關健康和生活習慣的問題，確保你適宜進行Xtreme Lashes&reg;植睫療程。<br /><br /> 在進行療程時，你只須要舒服地躺著，閉上雙眼就可。Xtreme Lashes&reg; 植睫療程無痛而且非常輕鬆，讓你頓時恢復年輕和活力。顧客在過程中都會不知不覺入睡，一覺醒來就可以擁有更長、更厚、更黑、更濃密的睫毛。<br /><br /> 為確保你的安全，在整個植睫的過程中，美睫師都不會將睫毛直接嫁接在皮膚上她們只會在你的自然睫毛上嫁接人工睫毛，因此顧客可以完全放心。<br /><br /> 另外，Xtreme Lashes&reg;註冊美睫師在為你嫁接睫毛時，只會使用安全且取得專利的Xtreme Lashes&reg;睫毛膠水。', 1),
(33, 6, 'video_expect', 'Video Link', 'https://www.youtube.com/embed/1bP-1hm7ljU', '', 2),
(34, 6, 'step_1', 'Step 1', '<center>\n<p class=\"steps-text\">The Pre-treatment Assessment</p>\n</center>\n<ol class=\"step-num\">\n<li>\n<p class=\"steps-text\">Our stylists will ask you about your health, lifestyle, skin and makeup routines to ensure eyelash extensions are right for you.</p>\n</li>\n<li>\n<p class=\"steps-text\">Next, they&rsquo;ll evaluate your eye and face shape, and show you our catalog of over 600 individual styles of extensions, so together you can design your ideal lash look.</p>\n</li>\n<li>\n<p class=\"steps-text\">In understanding that everyone&rsquo;s look is different, we custom design your lashes based on what will suit you best. Our ability to craft your special and different lash look is what makes us special too.</p>\n</li>\n</ol>', '<center>\n<p class=\"steps-text\">療程前，先評估！</p>\n</center>\n<p class=\"steps-text\">美睫師會了解你的健康狀況、生活和化妝習慣等，來評估你是否適合植睫和提供有關專業的意見，覺得自己的睫毛很短、很垂、很亂而且好多層，達唔到理想效果？每個人都是獨一無二，美睫師會運用超過600款睫毛，根據你的眼型和面型等，同你一齊設計最適合你的款式</p>', 3),
(35, 6, 'step_2', 'Step 2', '<center>\n<p class=\"steps-text\">Xtreme Lashes Lash Calculator&trade;</p>\n</center>\n<ol class=\"step-num\">\n<li>\n<p class=\"steps-text\">How do you know if your lashes will suit you? With the help of our online program Lash Calculator&trade;, of course! Our certified stylists will determine the ideal length, thickness and number of eyelash extensions to apply, all based on your natural eyelashes and desired look. Either way, we&rsquo;ll make sure your original lashes won&rsquo;t be weighed down and that your extensions look natural and &lsquo;just right&rsquo; for you.</p>\n</li>\n</ol>', '<center>\n<p class=\"steps-text\">Xtreme Lashes睫毛計算工具</p>\n</center>\n<p class=\"steps-text\">點樣知道哪款睫毛適合你呢？咁就要用我們的睫毛計數機啦！美睫師會根據你自然睫毛的粗度比較和想要的效果，來決定最適合你的睫毛長度、厚度和款式，確保你的自然睫毛不會負磅太重，令你睇起來自然得嚟「啱啱好」！</p>', 4),
(36, 6, 'step_3', 'Step 3', '<center>\n<p class=\"steps-text\">Application and Treatment</p>\n</center>\n<ol class=\"step-num\">\n<li>\n<p class=\"steps-text\">While you&rsquo;re comfortably reclined with your eyes closed, your stylist will expertly bond one eyelash extension to one natural lash. This process is repeated for all your natural lashes, creating a seamless and natural look and feel.</p>\n</li>\n<li>\n<p class=\"steps-text\">The application process takes around 1.5 to 2 hours and is painless, odour-free, relaxing and enjoyable. (Most clients fall asleep!)</p>\n</li>\n</ol>', '<center>\n<p class=\"steps-text\">過程輕鬆又舒服！</p>\n</center>\n<p class=\"steps-text\">當你舒適躺下後，美睫師會專業地將在合成睫毛逐一植上，位置大約係距離睫毛根部1 mm左右，療程大約需時1.5至2小時，毫無感覺，非常輕鬆且舒服，很多客人都會不知不覺睡著了！</p>', 5),
(37, 6, 'step_4', 'Step 4', '<center>\n<p class=\"steps-text\">Monitoring the Health of Your Lashes</p>\n</center>\n<ol class=\"step-num\">\n<li>\n<p class=\"steps-text\">The biggest myth is that lash extensions ruin your natural lashes. However, if applied correctly, lash extensions are safe and don&rsquo;t compromise the health of your own lashes. We&rsquo;ll also keep track of your lash condition and report on growth, so you can check in with us whenever, for total peace of mind.</p>\n</li>\n</ol>', '<center>\n<p class=\"steps-text\">療程後，再觀察！</p>\n</center>\n<p class=\"steps-text\">很多人認為植睫一定會傷害自然睫毛，但是其實只要嫁接方法正確，植睫就非常安全，完全不會影響到自然睫毛的健康。美睫師會在每次療程後拍下睫毛照片，為每個客人紀錄存檔，方便觀察和比較睫毛的生長和健康狀況。如果有任何疑問，歡迎向你的美睫師查詢啦！</p>', 6),
