(48, 1, 'map', 'Map Embed Code', '<iframe style=\"border: 0;\" src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3691.8875796398906!2d114.15292531453012!3d22.282247985332948!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3404007b464626a1%3A0x44e9b4b00a0c9edb!2sXtreme+Lashes+Hong+Kong!5e0!3m2!1sen!2s!4v1536222415192\" width=\"600\" height=\"450\" frameborder=\"0\" allowfullscreen=\"\"></iframe>', '', 4),
