(64, 9, 'content_area_product', 'Content Area', '', '<div class=\"col-md-12 d-none d-md-block text-center \">\n<h1>眼部零售產品</h1>\n</div>\n<center>\n<div class=\"col-md-7 sec3-text\">市場上有五花八門的眼妝眼部用品，睫毛液、睫毛夾、眼線筆、眼睫毛膠水，選用優質的用品非常重要。為了讓你的眼睫毛保持在最佳狀態，Xtreme Lashes已經為你準備好合適你的睫毛用品。 <br /><br /> 如果長時間使用化學眼妝用品，如又缺乏適當的護理，那麼睫毛就會變得脆弱，容易脫落。使用睫毛增長液就能夠解決這個問題，Xtreme Lashes的睫毛眉毛精華液可以令對抗稀疏老化的睫毛，可以令睫毛保持捲翹，也能加強睫毛增長的效果，令雙眼閃爍無窮。 <br /><br /> Xtreme Lashes同樣有自家的睫毛膏，一方面令睫毛有增長豐盈效果、另一方面亦不會破壞人工睫毛，破壞妝容效果，是完成Xtreme Lashes植睫毛療程的你的最佳睫毛液選擇。Xtreme Lashes比市面上其他種睫毛療程的優勝之處，在於令人驚嘆的自然效果，還有其細心入微的售後服務，包括專人跟進情況和合適人工睫毛的眼妝產品。</div>\n</center>', 0),
(65, 1, 'content_area_home', 'Content Area', '<h1 style=\"color: red;\">&nbsp;</h1>', '<div class=\"col-md-12 d-none d-md-block text-center \">\n<h1>Xtreme Lashes&reg; HK | 香港優質植睫毛品牌</h1>\n</div>\n<center>\n<div class=\"col-md-7 sec3-text\">不用塗睫毛液就可以擁有長長的眼睫毛是不少女孩子的心願。香港植睫毛技術不斷進步，植睫毛和種睫毛的效果和安全性亦大大提高，降低對本身睫毛的傷害。Xtreme Lashes是香港首屈一指的植眼睫毛專門店，提供獨有全方位的植眼睫毛服務，由睫毛師的專業諮詢到種眼睫毛療程，你都可以全程參與其中，和睫毛師一起選擇最合適你的美睫方案。植眼睫毛價錢收費各有不同，根據客人個別情況而定。我們的療程既快捷又無痛，只要閉上眼睛，增長眼睫毛就可以輕鬆完成！Xtreme Lashes更保證有專人跟進你的情況，保證你的美睫能夠有效持久。 <br /><br /> 植眼睫毛香港相當普遍，市面上有不少植睫毛療程，<span lang=\"ZH-TW\">中環、旺角、尖沙咀</span><span lang=\"EN-US\">K11</span><span lang=\"ZH-TW\">的植眼睫毛店琳琅滿目，儘管如此，</span><span lang=\"ZH-TW\">我們相信</span><span lang=\"EN-US\">Xtreme Lashes</span><span lang=\"ZH-TW\">能成為你的首選。位置中環的</span><span lang=\"EN-US\">Xtreme Lashes</span><span lang=\"ZH-TW\">植眼睫毛專門店使用的人工眼睫毛材質柔韌防皺，效果真實自然，完全展現植眼睫毛的</span><span lang=\"EN-US\">beauty</span><span lang=\"ZH-TW\">美學</span><span lang=\"ZH-TW\">。睫毛嫁接方便快捷，是繁忙都市女性的必然選擇</span>。</div>\n</center>', 5),
(66, 6, 'MEGA_VOLUME_HAS_ARRIVED', 'MEGA VOLUME HAS ARRIVED', '<h1>\r\nMEGA VOLUME HAS ARRIVED\r\n</h1>', ' <h1>\r\nMEGA VOLUME HAS ARRIVED cn\r\n</h1>', 1);
