(26, '120ml', '320.00', 'An award-winning aloe vera juice cleanser formulated with 6 nourishing botanical extracts that refresh and rejuvenate the skin, lashes, and brows.', '含有蘆薈及六種天然植物精華配方，有助溫和地卸除彩妝和清除雜質，舒緩肌膚、睫毛和眉毛。', 'An award-winning and nourishing cleanser formulated to effectively cleanse eyes and face without affecting eyelash extensions. Using coconut derived cleansing agents, this refreshing aloe vera juice formula gently removes all traces of makeup and impurities, while six botanical extracts calm and soothe skin, lashes, and brows.Contains six calming and soothing botanical extracts (chamomile, comfrey leaf, cucumber, eyebright, witch hazel and rose hip)Ideal for all skin types, even sensitive skinFormulated without artificial colors, fragrances, dyes or mineral oilCompatible with Xtreme Lashes Eyelash ExtensionsBeauty Launchpad Award Reader&rsquo;s Choice Best Eye Makeup RemoverShecky&rsquo;s Beauty At Its Best WinnerIf you wear Xtreme Lashes Eyelash Extensions, Jo Mousselli recommends reading eye makeup removal tips in More Details.', '<div>\n<div>曾榮獲美容獎項的眼部卸妝液含有滋養潔淨配方，能有效卸去眼妝和面部化妝，而不會輕易導致睫毛脫落。從椰子提煉出來的潔面乳，結合了清爽美顏的蘆薈及六種天然植物精華的配方，有助溫和地卸除彩妝和清除雜質，舒緩肌膚、睫毛和眉毛。</div>\n<div>&nbsp;</div>\n<div>⦁ 含六種具鎮靜舒緩作用的植物精華（洋甘菊、紫草葉、黃瓜、小米草、金縷梅、玫瑰果）</div>\n<div>⦁ 適合所有皮膚，包括敏感肌膚</div>\n<div>⦁ 配方不含人工色素、香料、染料和礦物油</div>\n<div>⦁ 能配合Xtreme Lashes&reg;的植睫技術</div>\n<div>&nbsp;</div>\n<div>榮獲Beauty Launchpad Award讀者選擇的最佳眼部卸妝液</div>\n</div>\n<div>&nbsp;</div>', 'EYE MAKEUP REMOVER & FACIAL CLEANSER', '眼部卸妝及潔面乳', 'bc6mu2bktcg8ss8og.jpg', '<title>{name} | Xtreme Lashes Hong Kong</title>\n        <meta name=\"description\" content=\"{description}\"/>\n        <meta name=\"robots\" content=\"noodp\"/>\n        <link rel=\"canonical\" href=\"{site_url}product/{slug}\" />\n        <meta property=\"og:locale\" content=\"en_US\" />\n        <meta property=\"og:type\" content=\"article\" />\n        <meta property=\"og:title\" content=\"{name} | Xtreme Lashes Hong Kong\" />\n        <meta property=\"og:description\" content=\"{description}\" />\n        <meta property=\"og:url\" content=\"{site_url}product/{slug}\" />\n        <meta property=\"og:site_name\" content=\"Xtreme Lashes Hong Kong\" />\n        <meta property=\"og:image\" content=\"{site_url}uploads/{thumbnail}\" />\n        <meta property=\"og:image:width\" content=\"328\" />\n        <meta property=\"og:image:height\" content=\"328\" />\n        <meta name=\"twitter:card\" content=\"summary\" />\n        <meta name=\"twitter:description\" content=\"{description}\" />\n        <meta name=\"twitter:title\" content=\"{name} | Xtreme Lashes Hong Kong\" />\n        <meta name=\"twitter:image\" content=\"{site_url}uploads/{thumbnail}\" />', '<title>{name_cn} | Xtreme Lashes Hong Kong</title>\n      <meta name=\"description\" content=\"{description_cn}\"/>\n      <meta name=\"robots\" content=\"noodp\"/>\n      <link rel=\"canonical\" href=\"{site_url}product/{slug}\" />\n      <meta property=\"og:locale\" content=\"en_US\" />\n      <meta property=\"og:type\" content=\"article\" />\n      <meta property=\"og:title\" content=\"{name_cn} | Xtreme Lashes Hong Kong\" />\n      <meta property=\"og:description\" content=\"{description_cn}\" />\n      <meta property=\"og:url\" content=\"{site_url}product/{slug}\" />\n      <meta property=\"og:site_name\" content=\"Xtreme Lashes Hong Kong\" />\n      <meta property=\"og:image\" content=\"{site_url}uploads/{thumbnail}\" />\n      <meta property=\"og:image:width\" content=\"328\" />\n      <meta property=\"og:image:height\" content=\"328\" />\n      <meta name=\"twitter:card\" content=\"summary\" />\n      <meta name=\"twitter:description\" content=\"{description_cn}\" />\n      <meta name=\"twitter:title\" content=\"{name_cn} | Xtreme Lashes Hong Kong\" />\n      <meta name=\"twitter:image\" content=\"{site_url}uploads/{thumbnail}\" />', 'eye-makeup-remover-facial-cleanser-120-ml', '', 'https://www.youtube.com/embed/1bP-1hm7ljU'),
(27, '', '550.00', 'Address fine lines, wrinkles, sagging skin, and puffiness with an advanced multi-tasking eye care solution from Xtreme Lashes.', 'Xtreme Lashes全效修復眼部精華能解決細紋、皺紋、皮膚鬆弛和眼袋問題。', '<p style=\"box-sizing: border-box; margin: 0px 0px 15px; font-size: 14px; color: #666666; font-family: lato, arial !important; line-height: 22px !important;\">Address fine lines, wrinkles, sagging skin, and puffiness with an advanced multi-tasking eye care solution from Xtreme Lashes by Jo Mousselli. This concentrated, oil-free serum has been clinically proven to hydrate, visibly firm, and reduce the appearance of aging on the delicate skin under the eyes and on the eyelids. Utilizing a powerful multi-peptide complex, this cutting-edge treatment helps promote skin&rsquo;s natural regenerative properties, resulting in more youthful-looking eyes.</p>\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; font-size: 14px; color: #666666; font-family: lato, arial !important; line-height: 22px !important;\">Multi-peptide Complex&nbsp;reduces the appearance of fine lines and wrinkles by promoting skin&rsquo;s natural mechanism to signal collagen production. This technology also helps prevent collagen breakdown triggered by naturally occurring enzymes that cause skin aging.</p>\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; font-size: 14px; color: #666666; font-family: lato, arial !important; line-height: 22px !important;\">MicroLift Complex&nbsp;provides instant and long-term benefits by improving tone and texture. Cork oak extract forms an invisible matrix on the skin&rsquo;s surface to visibly lift and firm the eye area, whileredensifying peptides penetrate deeper layers to restructure the look of sagging skin.</p>\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; font-size: 14px; color: #666666; font-family: lato, arial !important; line-height: 22px !important;\">Hyaluronic Sponge Delivery System&nbsp;utilizes microscopic hyaluronic acid sponges to carry active anti-aging ingredients into the skin. This hyaluronic acid network provides continuous hydration and delivery of active anti-aging ingredients through a sustained release system.</p>\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; font-size: 14px; color: #666666; font-family: lato, arial !important; line-height: 22px !important;\">In an independent clinical study, 86% of participants felt significant improvement in skin firmness after just 6 hours.</p>\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; font-size: 14px; color: #666666; font-family: lato, arial !important; line-height: 22px !important;\">The following percentage of participants also noticed significant improvements in the appearance of the following after 8 weeks:<br style=\"box-sizing: border-box;\" />Skin firmness 92%<br style=\"box-sizing: border-box;\" />Skin smoothness 89%<br style=\"box-sizing: border-box;\" />Reduced fine lines and wrinkles 86%<br style=\"box-sizing: border-box;\" />Reduced puffiness 81%</p>\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; font-size: 14px; color: #666666; font-family: lato, arial !important; line-height: 22px !important;\">Dermatologist and Ophthalmologist tested. Hypoallergenic. Compatible with Xtreme Lashes Eyelash Extensions.</p>', '<div>Xtreme Lashes全效修復眼部精華能解決細紋、皺紋、皮膚鬆弛和眼袋問題。經過臨床驗證，高濃度、不含油份的眼部修護精華能滋潤、緊緻眼部下方和上眼皮的幼嫩肌膚，減輕老化的痕跡。透過強力的多肽複合物加上尖端修護科技配合，有助促進肌膚天然再生，令雙眼顯得更年輕。</div>\n<div>&nbsp;</div>\n<div>多肽複合物可刺激皮膚的膠原蛋白增生，減少細紋和皺紋出現。另外，酶運作時會導致膠原蛋白分解，導致皮膚老化，眼部精華就能有助預防膠原蛋白分解。</div>\n<div>&nbsp;</div>\n<div>MicroLift複合物能改善皮膚色調和紋理，效果瞬間可見而且非常持久。提煉出來的栓皮櫟會在皮膚表面形成一層無形的基質，能顯著提升和緊緻眼部範圍的肌膚，而重組肽能穿透更深層的肌膚，改善皮膚鬆弛的問題。</div>\n<div>&nbsp;</div>\n<div>透明質酸海綿輸送系統是利用微小的透明質酸海綿將抗老化成分帶進皮膚。這個透明質酸的架構透過緩釋系統裡傳送抗老化分子，讓肌膚保持年輕及持久保濕。</div>\n<div>&nbsp;</div>\n<div>在一個獨立的臨床研究中，有86％的參加者認為在短短的6小時內，他們的肌膚都明顯變得緊緻。</div>\n<div>&nbsp;</div>\n<div>在8個星期後，下列百分比是參加者認為其皮膚在哪方面有顯著的改善：</div>\n<div>肌膚緊緻度92％</div>\n<div>肌膚平滑度89％</div>\n<div>減少細紋和皺紋86％</div>\n<div>減少浮腫81％</div>\n<div>**由皮膚科醫生和眼科醫生測試。不易過敏，能配合XtremeLashes的嫁接眼睫毛技術。</div>\n<div>&nbsp;</div>', 'TOTAL EYE REPAIR SERUM', '全效修復眼部精華', 'q1fo68juehccoo844c.jpg', '<title>{name} | Xtreme Lashes Hong Kong</title>\r\n        <meta name=\"description\" content=\"{description}\"/>\r\n        <meta name=\"robots\" content=\"noodp\"/>\r\n        <link rel=\"canonical\" href=\"{site_url}product/{slug}\" />\r\n        <meta property=\"og:locale\" content=\"en_US\" />\r\n        <meta property=\"og:type\" content=\"article\" />\r\n        <meta property=\"og:title\" content=\"{name} | Xtreme Lashes Hong Kong\" />\r\n        <meta property=\"og:description\" content=\"{description}\" />\r\n        <meta property=\"og:url\" content=\"{site_url}product/{slug}\" />\r\n        <meta property=\"og:site_name\" content=\"Xtreme Lashes Hong Kong\" />\r\n        <meta property=\"og:image\" content=\"{site_url}uploads/{thumbnail}\" />\r\n        <meta property=\"og:image:width\" content=\"328\" />\r\n        <meta property=\"og:image:height\" content=\"328\" />\r\n        <meta name=\"twitter:card\" content=\"summary\" />\r\n        <meta name=\"twitter:description\" content=\"{description}\" />\r\n        <meta name=\"twitter:title\" content=\"{name} | Xtreme Lashes Hong Kong\" />\r\n        <meta name=\"twitter:image\" content=\"{site_url}uploads/{thumbnail}\" />', '<title>{name_cn} | Xtreme Lashes Hong Kong</title>\r\n      <meta name=\"description\" content=\"{description_cn}\"/>\r\n      <meta name=\"robots\" content=\"noodp\"/>\r\n      <link rel=\"canonical\" href=\"{site_url}product/{slug}\" />\r\n      <meta property=\"og:locale\" content=\"en_US\" />\r\n      <meta property=\"og:type\" content=\"article\" />\r\n      <meta property=\"og:title\" content=\"{name_cn} | Xtreme Lashes Hong Kong\" />\r\n      <meta property=\"og:description\" content=\"{description_cn}\" />\r\n      <meta property=\"og:url\" content=\"{site_url}product/{slug}\" />\r\n      <meta property=\"og:site_name\" content=\"Xtreme Lashes Hong Kong\" />\r\n      <meta property=\"og:image\" content=\"{site_url}uploads/{thumbnail}\" />\r\n      <meta property=\"og:image:width\" content=\"328\" />\r\n      <meta property=\"og:image:height\" content=\"328\" />\r\n      <meta name=\"twitter:card\" content=\"summary\" />\r\n      <meta name=\"twitter:description\" content=\"{description_cn}\" />\r\n      <meta name=\"twitter:title\" content=\"{name_cn} | Xtreme Lashes Hong Kong\" />\r\n      <meta name=\"twitter:image\" content=\"{site_url}uploads/{thumbnail}\" />', 'total-eye-repair-serum', '', ''),
