x-sizing: border-box; font-weight: bold; font-size: 16px;\">fuller<span style=\"box-sizing: border-box; position: relative; font-size: 12px; line-height: 0; vertical-align: baseline; top: -0.5em; margin-bottom: 0px;\">2</span></span><br style=\"box-sizing: border-box;\" /><span style=\"box-sizing: border-box; font-weight: bold; font-size: 16px;\">85%</span>&nbsp;said lashes appear&nbsp;<span style=\"box-sizing: border-box; font-weight: bold; font-size: 16px;\">denser<span style=\"box-sizing: border-box; position: relative; font-size: 12px; line-height: 0; vertical-align: baseline; top: -0.5em; margin-bottom: 0px;\">2</span></span><br style=\"box-sizing: border-box;\" /><span style=\"box-sizing: border-box; font-weight: bold; font-size: 16px;\">90%</span>&nbsp;said lashes look&nbsp;<span style=\"box-sizing: border-box; font-weight: bold; font-size: 16px; margin-bottom: 0px;\">healthier<span style=\"box-sizing: border-box; position: relative; font-size: 12px; line-height: 0; vertical-align: baseline; top: -0.5em; margin-bottom: 0px;\">2</span></span></p>\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; font-weight: 400; font-size: 14px; color: #666666; font-family: lato, arial !important; line-height: 22px !important;\"><span style=\"box-sizing: border-box; font-weight: bold; font-size: 16px; margin-bottom: 0px;\">BROWS</span></p>\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; font-weight: 400; font-size: 14px; color: #666666; font-family: lato, arial !important; line-height: 22px !important;\"><span style=\"box-sizing: border-box; font-weight: bold; font-size: 16px;\">90%</span>&nbsp;said brows appear&nbsp;<span style=\"box-sizing: border-box; font-weight: bold; font-size: 16px;\">fuller<span style=\"box-sizing: border-box; position: relative; font-size: 12px; line-height: 0; vertical-align: baseline; top: -0.5em; margin-bottom: 0px;\">2</span></span><br style=\"box-sizing: border-box;\" /><span style=\"box-sizing: border-box; font-weight: bold; font-size: 16px;\">90%</span>&nbsp;said brows appear&nbsp;<span style=\"box-sizing: border-box; font-weight: bold; font-size: 16px;\">denser<span style=\"box-sizing: border-box; position: relative; font-size: 12px; line-height: 0; vertical-align: baseline; top: -0.5em; margin-bottom: 0px;\">2</span></span><br style=\"box-sizing: border-box;\" /><span style=\"box-sizing: border-box; font-weight: bold; font-size: 16px;\">90%</span>&nbsp;said brows look&nbsp;<span style=\"box-sizing: border-box; font-weight: bold; font-size: 16px; margin-bottom: 0px;\">healthier<span style=\"box-sizing: border-box; position: relative; font-size: 12px; line-height: 0; vertical-align: baseline; top: -0.5em; margin-bottom: 0px;\">1</span></span></p>\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; font-weight: 400; font-size: 14px; color: #666666; font-family: lato, arial !important; line-height: 22px !important;\"><span style=\"box-sizing: border-box; font-weight: bold; font-size: 16px; margin-bottom: 0px;\">OVERALL IMPACT</span></p>\n<p style=\"box-sizing: border-box; margin: 0px; font-weight: 400; font-size: 14px; color: #666666; font-family: lato, arial !important; line-height: 22px !important;\"><span style=\"box-sizing: border-box; font-weight: bold; font-size: 16px;\">75%</span>&nbsp;said their eye area looks more&nbsp;<span style=\"box-sizing: border-box; font-weight: bold; font-size: 16px; margin-bottom: 0px;\">youthful<span style=\"box-sizing: border-box; position: relative; font-size: 12px; line-height: 0; vertical-align: baseline; top: -0.5em; margin-bottom: 0px;\">2<br /><br /><br /></span></span></p>\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; font-weight: 400; font-size: 14px; color: #666666; font-family: lato, arial !important; line-height: 22px !important;\"><span style=\"box-sizing: border-box; font-weight: bold; font-size: 16px; margin-bottom: 0px;\">Behind the Science</span></p>\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; font-weight: 400; font-size: 14px; color: #666666; font-family: lato, arial !important; line-height: 22px !important;\">Amplifeye&reg; Advanced Lash &amp; Brow Fortifier harnesses the power of&nbsp;<span style=\"box-sizing: border-box; font-weight: bold; font-size: 16px;\">Amplifeye Renewal Complex&trade;</span>, comprised of liposome encapsulated peptides rich in amino acids.<br style=\"box-sizing: border-box; margin-bottom: 0px;\" />Amino acids are the building blocks of protein, which make up the lash and brow hair fibers. With age, amino acid levels gradually decline, resulting in weak, thin, short, and sparse eyelashes and brows. Amplifeye Advanced Lash &amp; Brow Fortifier contains a high concentration of amino acid-rich peptides to visibly nourish eyelashes and eyebrows.</p>\n<p style=\"box-sizing: border-box; margin: 0px; font-weight: 400; font-size: 14px; color: #666666; font-family: lato, arial !important; line-height: 22px !important;\">&nbsp;</p>\n<p style=\"box-sizing: border-box; margin: 0px; font-weight: 400; font-size: 14px; color: #666666; font-family: lato, arial !important; line-height: 22px !important;\">Individual results may vary. For maximum results, use daily and in combination with Amplifeye Lash, Brow &amp; Hair Formula.<br style=\"box-sizing: border-box;\" /><span style=\"box-sizing: border-box; font-weight: bold; font-size: 16px;\">1</span>&nbsp;4 week clinical study on women age 31-53<br style=\"box-sizing: border-box;\" /><span style=\"box-sizing: border-box; font-weight: bold; font-size: 16px; margin-bottom: 0px;\">2</span>&nbsp;12 week clinical study on women age 31-53</p>\n</div>', '<p style=\"box-sizing: border-box; margin: 0px 0px 15px; font-size: 14px; color: #666666; font-family: lato, arial !important; line-height: 22px !important;\">Amplifeye&reg;睫毛眉毛修護精華液有效對抗稀疏老化的睫毛和眉毛，由高濃度的維他命、天然植物精華及獨有的Amplifeye 再生複合物(Amplifeye Renewal Complex&trade;)所提煉而成的。Amplifeye&reg;以輕便、無黏性配方展現驚人的效果，每日使用能令你的睫毛及眉毛顯得更濃密、外貌顯得更年輕！</p>\n<p style=\"box-sizing: border-bo