(29, '', '400.00', 'Extend the life of eyelash extensions with a unique formula that seals and protects the attachment area. May also be used to hold eyelash extensions in place and add subtle sheen.', '獨特的配方能全面保護睫毛嫁接部分，也可以用來固定人工睫毛，為雙眼添上細緻的光澤，使植睫睫毛更持久。', 'Extend the life of eyelash extensions! This innovative formula coats and seals the attachment area between the eyelash extension and the natural eyelash, creating a protective barrier against oil, perspiration, dust and debris. Style, shape, and hold curl while adding a subtle sheen- in just one step!Adds longevity and protects eyelash extensionsContours, shapes, and holds eyelash extensions into placeEasy application with the slim mascara-style brushSafe on natural lashesRecommended use is one to two times per week only. Jo Mousselli recommends reading this product&rsquo;s application tips in More Details.0.34 fl. oz./10 ml', '<div>睫毛修護液能使植睫睫毛更持久，創新的配方能黏合及緊扣自然睫毛與人工睫毛之間的連接部分，建立一層防油、耐汗、阻隔灰塵和碎屑的保護膜。只需一步就可以定形睫毛，保持睫毛捲翹的效果，增添光澤！除了令人工睫毛維持得更持久，亦可定型及固定人工睫毛。配合纖細的睫毛刷頭，既容易使用，又不會傷害自然睫毛，效果相得益彰。</div>\n<div>&nbsp;</div>\n<div>建議每星期只使用一至兩次。</div>\n<div>&nbsp;</div>', 'PROTECTIVE COATING', '睫毛修護液', '1cepfvw1lh0kww4wco.png', '<title>{name} | Xtreme Lashes Hong Kong</title>\r\n        <meta name=\"description\" content=\"{description}\"/>\r\n        <meta name=\"robots\" content=\"noodp\"/>\r\n        <link rel=\"canonical\" href=\"{site_url}product/{slug}\" />\r\n        <meta property=\"og:locale\" content=\"en_US\" />\r\n        <meta property=\"og:type\" content=\"article\" />\r\n        <meta property=\"og:title\" content=\"{name} | Xtreme Lashes Hong Kong\" />\r\n        <meta property=\"og:description\" content=\"{description}\" />\r\n        <meta property=\"og:url\" content=\"{site_url}product/{slug}\" />\r\n        <meta property=\"og:site_name\" content=\"Xtreme Lashes Hong Kong\" />\r\n        <meta property=\"og:image\" content=\"{site_url}uploads/{thumbnail}\" />\r\n        <meta property=\"og:image:width\" content=\"3