(30, '6 Pairs', '180.00', '<span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">Instantly diminish the appearance of fine lines, wrinkles, and crow\'s feet with a moisture-locking hyaluronic acid treatment. 6 pairs.</span>', 'Xtreme Lashes保濕眼膜含有豐富的抗氧化劑，使眼睛瞬間回復活力。', 'Refresh and rejuvenate eyes instantly with an antioxidant-rich under eye treatment from Xtreme Lashes by Jo Mousselli. Formulated with hyaluronic acid to intensely hydrate and plump the skin to diminish the appearance of wrinkles, fine lines and crow&rsquo;s feet. Also contains Vitamin E, green tea, allantoin, ginseng, aloe vera, and glycerin to nourish and protect the skin from damaging free radicals. 6 pairs.', 'Xtreme Lashes保濕眼膜含有豐富的抗氧化劑，使眼睛瞬間回復活力。透明質酸配方有助強化保濕效果及緊緻肌膚，減淡皺紋、細紋及魚尾紋。眼膜亦含有維生素E、綠茶、尿囊素、人參、蘆薈、甘油等成份，能保護皮膚裡的自由基免受破壞，滋潤及呵護幼嫩肌膚。(每盒六片)', 'HYDRATING UNDER EYE GEL PATCH', '保濕啫喱眼膜', 'comokznoh0oo4gowc.jpg', '<title>{name} | Xtreme Lashes Hong Kong</title>\r\n        <meta name=\"description\" content=\"{description}\"/>\r\n        <meta name=\"robots\" content=\"noodp\"/>\r\n        <link rel=\"canonical\" href=\"{site_url}product/{slug}\" />\r\n        <meta property=\"og:locale\" content=\"en_US\" />\r\n        <meta property=\"og:type\" content=\"article\" />\r\n        <meta property=\"og:title\" content=\"{name} | Xtreme Lashes Hong Kong\" />\r\n        <meta property=\"og:description\" content=\"{description}\" />\r\n        <meta property=\"og:url\" content=\"{site_url}product/{slug}\" />\r\n        <meta property=\"og:site_name\" content=\"Xtreme Lashes Hong Kong\" />\r\n        <meta property=\"og:image\" content=\"{site_url}uploads/{thumbnail}\" />\r\n        <meta property=\"og:image:width\" content=\"328\" />\r\n        <meta property=\"og:image:height\" content=\"328\" />\r\n        <meta name=\"twitter:card\" content=\"summary\" />\r\n        <meta name=\"twitter:description\" content=\"{description}\" />\r\n        <meta name=\"twitter:title\" content=\"{name} | Xt