(31, 'Pack of 100', '180.00', '<span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">Flex Tip Applicators are an ideal alternative to traditional cotton swabs, which contain fibers that may get caught between natural eyelashes and eyelash extensions.</span>', '由於傳統的棉花棒都帶有纖維，會與自然睫毛及人工睫毛纏在一起，因此無絨的彎頭睫毛棒絕對是代替棉花棒的最佳選擇。', '<span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">Flex Tip Applicators are an ideal alternative to traditional cotton swabs, which contain fibers that may get caught between natural eyelashes and eyelash extensions.</span><br style=\"box-sizing: border-box; color: #666666; font-family: lato, arial; font-size: 14px;\" /><span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">Tackle stubborn mascara and eye makeup with this one-of-a-kind detailing brush. The flexible silicone paddle-style brush is specially designed to maneuver smoothly and gently across eye area contours. Lint-free bristles produce an effective makeup-lifting lather when used with Xtreme Lashes Eye Makeup Remover &amp; Facial Cleanser.</span>', '彎頭睫毛棒獨特的細緻刷頭，有助清除頑固的睫毛膏和眼妝。獨特設計的靈活矽槳式刷頭易於使用，能在眼部地方溫和流暢地移動。無絨刷毛能有助製造泡沫，與Xtreme Lashes的眼部卸妝及潔面乳一併使用時，更有效卸妝。', 'FLEX TIP APPLICATOR', '彎頭睫毛棒', 'w6fp511l26ockgo0s.jpg', '<title>{name} | Xtreme Lashes Hong Kong</title>\r\n        <meta name=\"description\" content=\"{description}\"/>\r\n        <meta name=\"robots\" content=\"noodp\"/>\r\n        <link rel=\"canonical\" href=\"{site_url}product/{slug}\" />\r\n        <meta property=\"og:locale\" content=\"en_US\" />\r\n        <meta property=\"og:type\" content=\"article\" />\r\n        <meta property=\"og:title\" content=\"{name} | Xtreme Lashes Hong Kong\" />\r\n        <meta property=\"og:description\" content=\"{description}\" />\r\n        <meta property=\"og:url\" content=\"{site_url}product/{slug}\" />\r\n        <meta property=\"og:site_name\" content=\"Xtreme Lashes Hong Kong\" />\r\n        <meta property=\"og:image\" content=\"{site_url}uploads/{thumbnail}\" />\r\n        <meta property=\"og:image:width\" content=\"328\" />\r\n        <meta property=\"og:image:height\" content=\"328\" />\r\n        <meta name=\"twitter:card\" content=\"summary\" />\r\n        <meta name=\"twitter:description\" content=\"{description}\" />\r\n        <meta name=\"twitter:title\" content=\"{name} | Xtreme Lashes Hong Kong\" />\r\n        <meta name=\"twitter:image\" content=\"{site_url}uploads/{thumbnail}\" />', '<title>{name_cn} | Xtreme Lashes Hong Kong</title>\r\n      <meta name=\"description\" content=\"{description_cn}\"/>\r\n      <meta name=\"robots\" content=\"noodp\"/>\r\n      <link rel=\"canonical\" href=\"{site_url}product/{slug}\" />\r\n      <meta property=\"og:locale\" content=\"en_US\" />\r\n      <meta property=\"og:type\" content=\"article\" />\r\n      <meta property=\"og:title\" content=\"{name_cn} | Xtreme Lashes Hong Kong\" />\r\n      <meta property=\"og:description\" content=\"{description_cn}\" />\r\n      <meta property=\"og:url\" content=\"{site_url}product/{slug}\" />\r\n      <meta property=\"og:site_name\" content=\"Xtreme Lashes Hong Kong\" />\r\n      <meta property=\"og:image\" content=\"{site_url}uploads/{thumbnail}\" />\r\n      <meta property=\"og:image:width\" content=\"328\" />\r\n      <meta property=\"og:image:height\" content=\"328\" />\r\n      <meta name=\"twitter:card\" content=\"summary\" />\r\n      <meta name=\"twitter:description\" content=\"{description_cn}\" />\r\n      <meta name=\"twitter:title\" content=\"{name_cn} | Xtreme Lashes Hong Kong\" />\r\n      <meta name=\"twitter:image\" content=\"{site_url}uploads/{thumbnail}\" />', 'flex-tip-applicator', '', ''),
(32, 'Pack of 100', '180.00', '<span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">Soft, gentle and multi-purpose, these cleansing tools are perfect for removing mascara, eyeliner and eye shadow with expert control.</span>', '柔軟且多用途的無絨睫毛棒，能讓你更專業完美地卸除睫毛膏、眼線和眼影。', '<span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">Soft, gentle and multi-purpose, these cleansing tools are perfect for removing mascara, eyeliner, and eye shadow with expert control. The unique applicator tip holds fluids in a non-drip suspension for targeted surface cleansing. Lint-Free Applicators are also an ideal alternative to traditional cotton swabs, which contain fibers that may get caught between natural eyelashes and eyelash extensions. Recommended for use with Eye Makeup Remover &amp; Facial Cleanser.</span>', '柔軟且多用途的無絨睫毛棒，能讓你更專業完美地卸除睫毛膏、眼線和眼影。獨特的刷頭能迅速吸收目標位置的卸妝液或者水，防止滴落。由於傳統的棉花棒都帶有纖維，會與自然睫毛及人工睫毛纏在一起，使用無絨睫毛棒就能免卻這煩惱。建議配合眼部卸妝及潔面乳一併使用。', 'LINT -FREE APPLICATOR', '無絨睫毛棒', 'h4wmv3ozbkoc0ko8c0.png', '<title>{name} | Xtreme Lashes Hong Kong</title>\r\n        <meta name=\"description\" content=\"{description}\"/>\r\n        <meta name=\"robots\" content=\"noodp\"/>\r\n        <link rel=\"canonical\" href=\"{site_url}product/{slug}\" />\r\n        <meta property=\"og:locale\" content=\"en_US\" />\r\n        <meta property=\"og:type\" content=\"article\" />\r\n        <meta property=\"og:title\" content=\"{name} | Xtreme Lashes Hong Kong\" />\r\n        <meta property=\"og:description\" content=\"{description}\" />\r\n        <meta property=\"og:url\" content=\"{site_url}product/{slug}\" />\r\n        <meta property=\"og:site_name\" content=\"Xtreme Lashes Hong Kong\" />\r\n        <meta property=\"og:image\" content=\"{site_url}uploads/{thumbnail}\" />\r\n        <meta property=\"og:image:width\" content=\"328\" />\r\n        <meta property=\"og:image:height\" content=\"328\" />\r\n        <meta name=\"twitter:card\" content=\"summary\" />\r\n        <meta name=\"twitter:description\" content=\"{description}\" />\r\n        <meta name=\"twitter:title\" content=\"{name} | Xtreme Lashes Hong Kong\" />\r\n        <meta name=\"twitter:image\" content=\"{site_url}uploads/{thumbnail}\" />', '<title>{name_cn} | Xtreme Lashes Hong Kong</title>\r\n      <meta name=\"description\" content=\"{description_cn}\"/>\r\n      <meta name=\"robots\" content=\"noodp\"/>\r\n      <link rel=\"canonical\" href=\"{site_url}product/{slug}\" />\r\n      <meta property=\"og:locale\" content=\"en_US\" />\r\n      <meta property=\"og:type\" content=\"article\" />\r\n      <meta property=\"og:title\" content=\"{name_cn} | Xtreme Lashes Hong Kong\" />\r\n      <meta property=\"og:description\" content=\"{description_cn}\" />\r\n      <meta property=\"og:url\" content=\"{site_url}product/{slug}\" />\r\n      <meta property=\"og:site_name\" content=\"Xtreme Lashes Hong Kong\" />\r\n      <meta property=\"og:image\" content=\"{site_url}uploads/{thumbnail}\" />\r\n      <meta property=\"og:image:width\" content=\"328\" />\r\n      <meta property=\"og:image:height\" content=\"328\" />\r\n      <meta name=\"twitter:card\" content=\"summary\" />\r\n      <meta name=\"twitter:description\" content=\"{description_cn}\" />\r\n      <meta name=\"twitter:title\" content=\"{name_cn} | Xtreme Lashes Hong Kong\" />\r\n      <meta name=\"twitter:image\" content=\"{site_url}uploads/{thumbnail}\" />', 'lint-free-applicator', '', ''),
(33, 'Pack of 100', '180.00', '<span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">This versatile elongated applicator aids both precision and larger area cleansing.</span>', '長型尖頭睫毛棒的增長尖頭刷頭能仔細清潔任何部分的眼妝', '<span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">This versatile elongated applicator aids both precision and larger area cleansing. The slim lint-free brush tip delivers a precise application of Xtreme Lashes Eye Makeup Remover or water in between and all over the eyelashes without dripping or leaving behind fiber particles that may become lodged at the attachment area. Also ideal for quick clean-up of eyeliner and mascara stains along the lash line and eyelid during makeup application.</span>', '長型尖頭睫毛棒的增長尖頭刷頭，能仔細清潔任何部分的眼妝。纖細的無絨刷頭能有效吸收Xtreme Lashes的眼部卸妝液或者水，避免纖維粒子遺留在睫毛上面、睫毛之間的空隙或睫毛嫁接的部位，快速清洗睫毛及眼瞼上的眼線和睫毛膏。', 'LONG TIPPED APPLICATOR', '長型尖頭睫毛棒', 'qp8cptvhjysow8kc8s.jpg', '<title>{name} | Xtreme Lashes Hong Kong</title>\r\n        <meta name=\"description\" content=\"{description}\"/>\r\n        <meta name=\"robots\" content=\"noodp\"/>\r\n        <link rel=\"canonical\" href=\"{site_url}product/{slug}\" />\r\n        <meta property=\"og:locale\" content=\"en_US\" />\r\n        <meta property=\"og:type\" content=\"article\" />\r\n        <meta property=\"og:title\" content=\"{name} | Xtreme Lashes Hong Kong\" />\r\n        <meta property=\"og:description\" content=\"{description}\" />\r\n        <meta property=\"og:url\" content=\"{site_url}product/{slug}\" />\r\n        <meta property=\"og:site_name\" content=\"Xtreme Lashes Hong Kong\" />\r\n        <meta property=\"og:image\" content=\"{site_url}uploads/{thumbnail}\" />\r\n        <meta property=\"og:image:width\" content=\"328\" />\r\n        <meta property=\"og:image:height\" content=\"328\" />\r\n        <meta name=\"twitter:card\" content=\"summary\" />\r\n        <meta name=\"twitter:description\" content=\"{description}\" />\r\n        <meta name=\"twitter:title\" content=\"{name} | Xtreme Lashes Hong Kong\" />\r\n        <meta name=\"twitter:image\" content=\"{site_url}uploads/{thumbnail}\" />', '<title>{name_cn} | Xtreme Lashes Hong Kong</title>\r\n      <meta name=\"description\" content=\"{description_cn}\"/>\r\n      <meta name=\"robots\" content=\"noodp\"/>\r\n      <link rel=\"canonical\" href=\"{site_url}product/{slug}\" />\r\n      <meta property=\"og:locale\" content=\"en_US\" />\r\n      <meta property=\"og:type\" content=\"article\" />\r\n      <meta property=\"og:title\" content=\"{name_cn} | Xtreme Lashes Hong Kong\" />\r\n      <meta property=\"og:description\" content=\"{description_cn}\" />\r\n      <meta property=\"og:url\" content=\"{site_url}product/{slug}\" />\r\n      <meta property=\"og:site_name\" content=\"Xtreme Lashes Hong Kong\" />\r\n      <meta property=\"og:image\" content=\"{site_url}uploads/{thumbnail}\" />\r\n      <meta property=\"og:image:width\" content=\"328\" />\r\n      <meta property=\"og:image:height\" content=\"328\" />\r\n      <meta name=\"twitter:card\" content=\"summary\" />\r\n      <meta name=\"twitter:description\" content=\"{description_cn}\" />\r\n      <meta name=\"twitter:title\" content=\"{name_cn} | Xtreme Lashes Hong Kong\" />\r\n      <meta name=\"twitter:image\" content=\"{site_url}uploads/{thumbnail}\" />', 'long-tipped-applicator', '', ''),
(34, '', '100.00', '<span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">View standard reflection and 2x magnification with this dual-sided mirror compact.</span>', '這款化妝鏡能提供兩種效果，一面為正常鏡子，另一面可以放大兩倍。', '<span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">An essential accessory for women on the go! This dual-sided Compact Mirror features a standard mirror for accurate reflection on one side and a 2x magnified mirror for more detailed viewing on the other. Approximately 2.5&Prime; in diameter.</span>', '化妝鏡可以說是女性必備的美容工具。這款直徑約為2.5吋的化妝鏡一面為正常鏡子，另一面為兩倍放大鏡，可以看得更仔細。', 'COMPACT MIRROR', 'Xtreme Lashes®化妝鏡', '7bm4n6cvkmko4ow880.jpg', '<title>{name} | Xtreme Lashes Hong Kong</title>\r\n        <meta name=\"description\" content=\"{description}\"/>\r\n        <meta name=\"robots\" content=\"noodp\"/>\r\n        <link rel=\"canonical\" href=\"{site_url}product/{slug}\" />\r\n        <meta property=\"og:locale\" content=\"en_US\" />\r\n        <meta property=\"og:type\" content=\"article\" />\r\n        <meta property=\"og:title\" content=\"{name} | Xtreme Lashes Hong Kong\" />\r\n        <meta property=\"og:description\" content=\"{description}\" />\r\n        <meta property=\"og:url\" content=\"{site_url}product/{slug}\" />\r\n        <meta property=\"og:site_name\" content=\"Xtreme Lashes Hong Kong\" />\r\n        <meta property=\"og:image\" content=\"{site_url}uploads/{thumbnail}\" />\r\n        <meta property=\"og:image:width\" content=\"328\" />\r\n        <meta property=\"og:image:height\" content=\"328\" />\r\n        <meta name=\"twitter:card\" content=\"summary\" />\r\n        <meta name=\"twitter:description\" content=\"{description}\" />\r\n        <meta name=\"twitter:title\" content=\"{name} | Xtreme Lashes Hong Kong\" />\r\n        <meta name=\"twitter:image\" content=\"{site_url}uploads/{thumbnail}\" />', '<title>{name_cn} | Xtreme Lashes Hong Kong</title>\r\n      <meta name=\"description\" content=\"{description_cn}\"/>\r\n      <meta name=\"robots\" content=\"noodp\"/>\r\n      <link rel=\"canonical\" href=\"{site_url}product/{slug}\" />\r\n      <meta property=\"og:locale\" content=\"en_US\" />\r\n      <meta property=\"og:type\" content=\"article\" />\r\n      <meta property=\"og:title\" content=\"{name_cn} | Xtreme Lashes Hong Kong\" />\r\n      <meta property=\"og:description\" content=\"{description_cn}\" />\r\n      <meta property=\"og:url\" content=\"{site_url}product/{slug}\" />\r\n      <meta property=\"og:site_name\" content=\"Xtreme Lashes Hong Kong\" />\r\n      <meta property=\"og:image\" content=\"{site_url}uploads/{thumbnail}\" />\r\n      <meta property=\"og:image:width\" content=\"328\" />\r\n      <meta property=\"og:image:height\" content=\"328\" />\r\n      <meta name=\"twitter:card\" content=\"summary\" />\r\n      <meta name=\"twitter:description\" content=\"{description_cn}\" />\r\n      <meta name=\"twitter:title\" content=\"{name_cn} | Xtreme Lashes Hong Kong\" />\r\n      <meta name=\"twitter:image\" content=\"{site_url}uploads/{thumbnail}\" />', 'compact-mirror', '', '');
