(35, '', '250.00', '<span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">Groom lashes and brows on-the-go with this elegantly-designed retractable brush. This item is temporary out of stock and will ship early August.</span>', '這支設計優雅的伸縮睫毛掃可以有效梳理睫毛和眉毛。', '<span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">Primp lashes and brows&nbsp;to perfection with this eye-catching styling brush. The retractable design and patented collar allow you to protect the brush head from damage and debris. Compact and stylish, this styling tool is ideal for use at home and on-the-go! This item is temporary out of stock and will ship early August.</span>', '這款亮麗的睫毛掃能完美梳理你的睫毛及眉毛。伸縮設計及獨特的套管讓你能保護睫毛刷頭免受損壞及阻隔灰塵。小巧時髦的設計讓你在家或在外使用都一樣方便。', 'DELUXE RETRACTABLE LASH STYLING WAND', '伸縮睫毛掃', '1xmkh8ftb2e8k8804g.png', '<title>{name} | Xtreme Lashes Hong Kong</title>\r\n        <meta name=\"description\" content=\"{description}\"/>\r\n        <meta name=\"robots\" content=\"noodp\"/>\r\n        <link rel=\"canonical\" href=\"{site_url}product/{slug}\" />\r\n        <meta property=\"og:locale\" content=\"en_US\" />\r\n        <meta property=\"og:type\" content=\"article\" />\r\n        <meta property=\"og:title\" content=\"{name} | Xtreme Lashes Hong Kong\" />\r\n        <meta property=\"og:description\" content=\"{description}\" />\r\n        <meta property=\"og:url\" content=\"{site_url}product/{slug}\" />\r\n        <meta property=\"og:site_name\" content=\"Xtreme Lashes Hong Kong\" />\r\n        <meta property=\"og:image\" content=\"{site_url}uploads/{thumbnail}\" />\r\n        <meta property=\"og:image:width\" content=\"328\" />\r\n        <meta property=\"og:image:height\" content=\"328\" />\r\n        <meta name=\"twitter:card\" content=\"summary\" />\r\n        <meta name=\"twitter:description\" content=\"{description}\" />\r\n        <meta name=\"twitter:title\" content=\"{name} | Xtreme Lashes Hong Kong\" />\r\n        <meta name=\"twitter:image\" content=\"{site_url}uploads/{thumbnail}\" />', '<title>{name_cn} | Xtreme Lashes Hong Kong</title>\r\n      <meta name=\"description\" content=\"{description_cn}\"/>\r\n      <meta name=\"robots\" content=\"noodp\"/>\r\n      <link rel=\"canonical\" href=\"{site_url}product/{slug}\" />\r\n      <meta property=\"og:locale\" content=\"en_US\" />\r\n      <meta property=\"og:type\" content=\"article\" />\r\n      <meta property=\"og:title\" content=\"{name_cn} | Xtreme Lashes Hong Kong\" />\r\n      <meta property=\"og:description\" content=\"{description_cn}\" />\r\n      <meta property=\"og:url\" content=\"{site_url}product/{slug}\" />\r\n      <meta property=\"og:site_name\" content=\"Xtreme Lashes Hong Kong\" />\r\n      <meta property=\"og:image\" content=\"{site_url}uploads/{thumbnail}\" />\r\n      <meta property=\"og:image:width\" content=\"328\" />\r\n      <meta property=\"og:image:height\" content=\"328\" />\r\n      <meta name=\"twitter:card\" content=\"summary\" />\r\n      <meta name=\"twitter:description\" content=\"{description_cn}\" />\r\n      <meta name=\"twitter:title\" content=\"{name_cn} | Xtreme Lashes Hong Kong\" />\r\n      <meta name=\"twitter:image\" content=\"{site_url}uploads/{thumbnail}\" />', 'deluxe-retractable-lash-styling-wand', '', ''),
(36, '', '400.00', '', '', '<span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">Quickly and gently dry eyelash extensions after cleansing with this powerful, yet compact-sized Mini Fan. Targeted airflow exits from the top of the fan for optimal control during the drying and styling process. Three AAA batteries included. Approximately 2.6&Prime; x 4.8&Prime;.Ideal for all eyelash extension wearers, especially those who received a multi-lash application (Volumation&trade;).</span>', '這款小巧而強力的迷你風扇能在清潔睫毛後快速溫和地吹乾睫毛，風扇頂部的風口能更有效對準及吹乾睫毛。產品包含了3A電池。尺寸大約為2.6吋乘4.8吋。此款風扇適合任何植上睫毛的客人，特別是進行過Volumation&trade;植睫的客人。', 'MINI FAN', '迷你風扇', '1ie0j4uxq7hccw4c.png', '<title>{name} | Xtreme Lashes Hong Kong</title>\r\n        <meta name=\"description\" content=\"{description}\"/>\r\n        <meta name=\"robots\" content=\"noodp\"/>\r\n        <link rel=\"canonical\" href=\"{site_url}product/{slug}\" />\r\n        <meta property=\"og:locale\" content=\"en_US\" />\r\n        <meta property=\"og:type\" content=\"article\" />\r\n        <meta property=\"og:title\" content=\"{name} | Xtreme Lashes Hong Kong\" />\r\n        <meta property=\"og:description\" content=\"{description}\" />\r\n        <meta property=\"og:url\" content=\"{site_url}product/{slug}\" />\r\n        <meta property=\"og:site_name\" content=\"Xtreme Lashes Hong Kong\" />\r\n        <meta property=\"og:image\" content=\"{site_url}uploads/{thumbnail}\" />\r\n        <meta property=\"og:image:width\" content=\"328\" />\r\n        <meta property=\"og:image:height\" content=\"328\" />\r\n        <meta name=\"twitter:card\" content=\"summary\" />\r\n        <meta name=\"twitter:description\" content=\"{description}\" />\r\n        <meta name=\"twitter:title\" content=\"{name} | Xtreme Lashes Hong Kong\" />\r\n        <meta name=\"twitter:image\" content=\"{site_url}uploads/{thumbnail}\" />', '<title>{name_cn} | Xtreme Lashes Hong Kong</title>\r\n      <meta name=\"description\" content=\"{description_cn}\"/>\r\n      <meta name=\"robots\" content=\"noodp\"/>\r\n      <link rel=\"canonical\" href=\"{site_url}product/{slug}\" />\r\n      <meta property=\"og:locale\" content=\"en_US\" />\r\n      <meta property=\"og:type\" content=\"article\" />\r\n      <meta property=\"og:title\" content=\"{name_cn} | Xtreme Lashes Hong Kong\" />\r\n      <meta property=\"og:description\" content=\"{description_cn}\" />\r\n      <meta property=\"og:url\" content=\"{site_url}product/{slug}\" />\r\n      <meta property=\"og:site_name\" content=\"Xtreme Lashes Hong Kong\" />\r\n      <meta property=\"og:image\" content=\"{site_url}uploads/{thumbnail}\" />\r\n      <meta property=\"og:image:width\" content=\"328\" />\r\n      <meta property=\"og:image:height\" content=\"328\" />\r\n      <meta name=\"twitter:card\" content=\"summary\" />\r\n      <meta name=\"twitter:description\" content=\"{description_cn}\" />\r\n      <meta name=\"twitter:title\" content=\"{name_cn} | Xtreme Lashes Hong Kong\" />\r\n      <meta name=\"twitter:image\" content=\"{site_url}uploads/{thumbnail}\" />', 'mini-fan', '', ''),
(37, '', '300.00', '<span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">Apply Long Lasting Brow Pen pigments with full control, from arch to tip. The tapered natural fibers allow for targeted blending and shaping.</span>', '<div>能有效從眉弓到尖端，控制眉筆的深淺，尖細自然的纖維能更準確地上色及造型。</div>\n<div>&nbsp;</div>', '<span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">Beautifully sculpt and perfect brows with the Angled Brush. Made with high quality durable fibers, this brush provides a firm, yet soft application for enhanced precision and ease. Use it to blend, fill, and shape Long Lasting Brow Pen pigments with full control from arch to tip.&nbsp;Insider Tips:&nbsp; The Angled Brush is ideal for creating a soft, natural finish. This brush can also be used with GlideLiner Long Lasting Eye Pencil to create a thin and precise line.</span>', '以斜角眉掃塑造完美漂亮的眉毛，這款斜角眉掃由高品質纖維制成，堅挺而柔軟，能更準確及容易地上色，有效從眉弓到尖端控制持久性眉筆的深淺造型。行家貼士︰這款斜角眉掃方便勾勒造型，亦可以配合GlideLiner&trade;眼線筆，繪畫更幼細的線條。', 'ANGLED BRUSH', '斜角眉掃', '2hq9z0f83vi8w8g0wc.png', '<title>{name} | Xtreme Lashes Hong Kong</title>\r\n        <meta name=\"description\" content=\"{description}\"/>\r\n        <meta name=\"robots\" content=\"noodp\"/>\r\n        <link rel=\"canonical\" href=\"{site_url}product/{slug}\" />\r\n        <meta property=\"og:locale\" content=\"en_US\" />\r\n        <meta property=\"og:type\" content=\"article\" />\r\n        <meta property=\"og:title\" content=\"{name} | Xtreme Lashes Hong Kong\" />\r\n        <meta property=\"og:description\" content=\"{description}\" />\r\n        <meta property=\"og:url\" content=\"{site_url}product/{slug}\" />\r\n        <meta property=\"og:site_name\" content=\"Xtreme Lashes Hong Kong\" />\r\n        <meta property=\"og:image\" content=\"{site_url}uploads/{thumbnail}\" />\r\n        <meta property=\"og:image:width\" content=\"328\" />\r\n        <meta property=\"og:image:height\" content=\"328\" />\r\n        <meta name=\"twitter:card\" content=\"summary\" />\r\n        <meta name=\"twitter:description\" content=\"{description}\" />\r\n        <meta name=\"twitter:title\" content=\"{name} | Xtreme Lashes Hong Kong\" />\r\n        <meta name=\"twitter:image\" content=\"{site_url}uploads/{thumbnail}\" />', '<title>{name_cn} | Xtreme Lashes Hong Kong</title>\r\n      <meta name=\"description\" content=\"{description_cn}\"/>\r\n      <meta name=\"robots\" content=\"noodp\"/>\r\n      <link rel=\"canonical\" href=\"{site_url}product/{slug}\" />\r\n      <meta property=\"og:locale\" content=\"en_US\" />\r\n      <meta property=\"og:type\" content=\"article\" />\r\n      <meta property=\"og:title\" content=\"{name_cn} | Xtreme Lashes Hong Kong\" />\r\n      <meta property=\"og:description\" content=\"{description_cn}\" />\r\n      <meta property=\"og:url\" content=\"{site_url}product/{slug}\" />\r\n      <meta property=\"og:site_name\" content=\"Xtreme Lashes Hong Kong\" />\r\n      <meta property=\"og:image\" content=\"{site_url}uploads/{thumbnail}\" />\r\n      <meta property=\"og:image:width\" content=\"328\" />\r\n      <meta property=\"og:image:height\" content=\"328\" />\r\n      <meta name=\"twitter:card\" content=\"summary\" />\r\n      <meta name=\"twitter:description\" content=\"{description_cn}\" />\r\n      <meta name=\"twitter:title\" content=\"{name_cn} | Xtreme Lashes Hong Kong\" />\r\n      <meta name=\"twitter:image\" content=\"{site_url}uploads/{thumbnail}\" />', 'angled-brush', '', ''),
(38, '', '180.00', '<span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">Exclusively designed sharpener creates the ideal tip for perfectly lining the eye with GlideLiner Long Lasting Eye Pencil.</span>', '獨特設計的筆刨令眼線筆頭變得尖細，就能勾畫出更完美的眼線。', '<span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">Designed to ensure the artistic potential of GlideLiner Long Lasting Eye Pencil, this sharpener uses an Eisen second-blade system to create the ideal tip for precise and easy eye lining. For best results, sharpen GlideLiner Long Lasting Eye Pencil prior to each use.</span>', '這款筆刨能配合Xtreme Lashes&reg;眼線筆(GlideLiner)使用，Eisen雙刀片設計能更容易削尖筆頭，有助更準確地勾勒眼線。為了達到最佳效果，我們建議你在每次使用Xtreme Lashes&reg;眼線筆前都先使用筆刨。', 'GLIDELINER™ SHARPENER', 'GLIDELINER™眼線筆刨', 'ebe5xxg3aw0ksc8k.png', '<title>{name} | Xtreme Lashes Hong Kong</title>\r\n        <meta name=\"description\" content=\"{description}\"/>\r\n        <meta name=\"robots\" content=\"noodp\"/>\r\n        <link rel=\"canonical\" href=\"{site_url}product/{slug}\" />\r\n        <meta property=\"og:locale\" content=\"en_US\" />\r\n        <meta property=\"og:type\" content=\"article\" />\r\n        <meta property=\"og:title\" content=\"{name} | Xtreme Lashes Hong Kong\" />\r\n        <meta property=\"og:description\" content=\"{description}\" />\r\n        <meta property=\"og:url\" content=\"{site_url}product/{slug}\" />\r\n        <meta property=\"og:site_name\" content=\"Xtreme Lashes Hong Kong\" />\r\n        <meta property=\"og:image\" content=\"{site_url}uploads/{thumbnail}\" />\r\n        <meta property=\"og:image:width\" content=\"328\" />\r\n        <meta property=\"og:image:height\" content=\"328\" />\r\n        <meta name=\"twitter:card\" content=\"summary\" />\r\n        <meta name=\"twitter:description\" content=\"{description}\" />\r\n        <meta name=\"twitter:title\" content=\"{name} | Xtreme Lashes Hong Kong\" />\r\n        <meta name=\"twitter:image\" content=\"{site_url}uploads/{thumbn