(39, '', '400.00', '<span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">Add high-impact length and volume to lashes without clumps, flakes, or smudges. The conditioning Vitamin B5 formula is gentle and easy to remove.</span>', '使用增長豐盈睫毛膏，睫毛不會變得雜亂、形成污垢或出現暈染，睫毛膏內添加的維他命B5性質溫和、容易卸除。', '<span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">Featuring a large, lash-maximizing brush that thickens each lash from base to tip &ndash; extreme length and volume is achieved. This color-rich formula creates high-impact definition, volume, and separation without any clumps, flakes, or smudges. With lash conditioning ingredients and a formula that doesn&rsquo;t disrupt eyelash extensions, the Xtreme Lashes by Jo Mousselli Length &amp; Volume is a must-have mascara that can do it all.Long-lasting, water-based formulaVitamin B-enrichedIdeal for sensitive eyes and contact lens safeRemoves easily with&nbsp;Eye Makeup Remover &amp; Facial CleanserCompatible with&nbsp;Xtreme Lashes Eyelash Extensions and natural lashesIf you wear Xtreme Lashes Eyelash Extensions, Jo Mousselli recommends reading this product&rsquo;s application and removal tips in More Details.</span>', '<div>大型刷頭設計能將睫毛膏從睫毛根部平均掃上尖端，增加睫毛厚度，從而達到睫毛增長豐盈的效果。這種顏色豐富的處方能有效地分離每根睫毛，達致增量的效果，而不會令睫毛變得雜亂、形成污垢或出現暈染。修護睫毛配方不會破壞人工睫毛，Jo Mousselli 的Xtreme Lashes&reg;增長豐盈睫毛液絕對是一支你不可缺少的睫毛膏。</div>\n<div>&nbsp;</div>\n<div>⦁ 持久、水溶性配方</div>\n<div>⦁ 蘊含豐富的維他命B</div>\n<div>⦁ 適合敏感眼睛及佩戴隱形眼鏡人士</div>\n<div>⦁ 使用眼部卸妝及潔面乳簡單卸除</div>\n<div>⦁ 配合自然睫毛及Xtreme Lashes&reg;的人工睫毛</div>\n<div>&nbsp;</div>', 'LENGTH & VOLUME MASCARA', 'Xtreme Lashes®增長豐盈睫毛膏', 'jx1grm5ob4gck40ko.png', '<title>{name} | Xtreme Lashes Hong Kong</title>\r\n        <meta name=\"description\" content=\"{description}\"/>\r\n        <meta name=\"robots\" content=\"noodp\"/>\r\n        <link rel=\"canonical\" href=\"{site_url}product/{slug}\" />\r\n        <meta property=\"og:locale\" content=\"en_US\" />\r\n        <meta property=\"og:type\" content=\"article\" />\r\n        <meta property=\"og:title\" content=\"{name} | Xtreme Lashes Hong Kong\" />\r\n        <meta property=\"og:description\" content=\"{description}\" />\r\n        <meta property=\"og:url\" content=\"{site_url}product/{slug}\" />\r\n        <meta property=\"og:site_name\" content=\"Xtreme Lashes Hong Kong\" />\r\n        <meta property=\"og:image\" content=\"{site_url}uploads/{thumbnail}\" />\r\n        <meta property=\"og:image:width\" content=\"328\" />\r\n        <meta property=\"og:image:height\" content=\"328\" />\r\n        <meta name=\"twitter:card\" content=\"summary\" />\r\n        <meta name=\"twitter:description\" content=\"{description}\" />\r\n        <meta name=\"twitter:title\" content=\"{name} | Xtreme Lashes Hong Kong\" />\r\n        <meta name=\"twitter:image\" content=\"{site_url}uploads/{thumbnail}\" />', '<title>{name_cn} | Xtreme Lashes Hong Kong</title>\r\n      <meta name=\"description\" content=\"{description_cn}\"/>\r\n      <meta name=\"robots\" content=\"noodp\"/>\r\n      <link rel=\"canonical\" href=\"{site_url}product/{slug}\" />\r\n      <meta property=\"og:locale\" content=\"en_US\" />\r\n      <meta property=\"og:type\" content=\"article\" />\r\n      <meta property=\"og:title\" content=\"{name_cn} | Xtreme Lashes Hong Kong\" />\r\n      <meta property=\"og:description\" content=\"{description_cn}\" />\r\n      <meta property=\"og:url\" content=\"{site_url}product/{slug}\" />\r\n      <meta property=\"og:site_name\" content=\"Xtreme Lashes Hong Kong\" />\r\n      <meta property=\"og:image\" content=\"{site_url}uploads/{thumbnail}\" />\r\n      <meta property=\"og:image:width\" content=\"328\" />\r\n      <meta property=\"og:image:height\" content=\"328\" />\r\n      <meta name=\"twitter:card\" content=\"summary\" />\r\n      <meta name=\"twitter:description\" content=\"{description_cn}\" />\r\n      <meta name=\"twitter:title\" content=\"{name_cn} | Xtreme Lashes Hong Kong\" />\r\n      <meta name=\"twitter:ima