(40, '', '100.00', '<span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">A cleansing tool that aids with targeted and all-over cleansing of the eye area and face. Ideal for eyelash extension wearers due to its lint-free texture. 40-pack.</span>', '無乳膠化妝棉能全面地清潔眼部和面部，其無絨質地適合已植睫的客人。每包40塊。', '<span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">These lint-free professional cleansing sponges offer the quality, size, texture, and firmness that is essential for targeted and all-over cleansing of eye area and face. Its absorbency and softness is ideal for daily makeup removal. Latex-free. 40-pack.Ideal for eyelash extension wearers due to its lint-free texture.</span>', '<div>這種無絨專業清潔化妝棉，能讓你更方便全面地清潔眼部和面部，品質、大小、質地、堅硬度、吸水性及柔軟度絕對是你每日卸妝的首選。</div>\n<div>&nbsp;</div>\n<div>⦁ 無乳膠</div>\n<div>⦁ 每包40塊</div>\n<div>⦁ 無絨質地適合植睫客人</div>', 'COSMETIC SPONGES', '無乳膠化妝棉', 'gbol73d7cn40o04k4o.jpg', '<title>{name} | Xtreme Lashes Hong Kong</title>\r\n        <meta name=\"description\" content=\"{description}\"/>\r\n        <meta name=\"robots\" content=\"noodp\"/>\r\n        <link rel=\"canonical\" href=\"{site_url}product/{slug}\" />\r\n        <meta property=\"og:locale\" content=\"en_US\" />\r\n        <meta property=\"og:type\" content=\"article\" />\r\n        <meta property=\"og:title\" content=\"{name} | Xtreme Lashes Hong Kong\" />\r\n        <meta property=\"og:description\" content=\"{description}\" />\r\n        <meta property=\"og:url\" content=\"{site_url}product/{slug}\" />\r\n        <meta property=\"og:site_name\" content=\"Xtreme Lashes Hong Kong\" />\r\n        <meta property=\"og:image\" content=\"{site_url}uploads/{thumbnail}\" />\r\n        <meta property=\"og:image:width\" content=\"328\" />\r\n        <meta property=\"og:image:height\" content=\"328\" />\r\n        <meta name=\"twitter:card\" content=\"summary\" />\r\n        <meta name=\"twitter:description\" content=\"{description}\" />\r\n        <meta name=\"twitter:title\"