(41, '', '350.00', '<span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">Define brows effortlessly with natural-looking color in a long-wear finish.</span>', 'Xtreme Lashes&reg;持久性眉筆能讓你不費吹灰之力勾畫自然的眉毛，亮麗持久', '<span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">Achieve flawless, sculpted brows with ease and confidence! This innovative formula fills sparse areas, evenly tints each hair, and disguises grays for a natural, youthful appearance. The soft-tipped pen allows for an effortless application without any waxy buildup or powder residue.Insider Tips:&nbsp; Deep is a universal brown that suits cool blondes, light brown to deep brown or black hair. To read more about application and removal, please click here. product should be applied to brows that are clean, dry, free of skincare, and following face makeup/powder application. Watch the training video now.</span>', '讓你更容易、更自信地勾畫完美眉形，持久性眉筆的創新配方能填補稀疏的睫毛、平均地為每條眉毛染上顏色，同時掩蓋瑕疵，打造自然年輕的外表。這款柔軟尖細的眉筆使用方法簡單，而且不會留下任何蠟質或粉粒。（貼士︰Deep是一種常用的棕色，適合擁有藍眼睛或淺啡色、深啡色甚至黑髮的客人。在使用前請確保眉毛清潔、乾爽、沒有沾上任何護膚品或化妝品。）', 'LONG LASTING BROW PEN', 'Xtreme Lashes®持久性眉筆', 'xtnh21jca28s40kswk.jpg', '<title>{name} | Xtreme Lashes Hong Kong</title>\r\n        <meta name=\"description\" content=\"{description}\"/>\r\n        <meta name=\"robots\" content=\"noodp\"/>\r\n        <link rel=\"canonical\" href=\"{site_url}product/{slug}\" />\r\n        <meta property=\"og:locale\" content=\"en_US\" />\r\n        <meta property=\"og:type\" content=\"article\" />\r\n        <meta property=\"og:title\" content=\"{name} | Xtreme Lashes Hong Kong\" />\r\n        <meta property=\"og:description\" content=\"{description}\" />\r\n        <meta property=\"og:url\" content=\"{site_url}product/{slug}\" />\r\n        <meta property=\"og:site_name\" content=\"Xtreme Lashes Hong Kong\" />\r\n        <meta property=\"og:image\" content=\"{site_url}uploads/{thumbnail}\" />\r\n        <meta property=\"og:image:width\" content=\"328\" />\r\n  