(42, '', '220.00', '', '', '<span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">Inspired by Jo Mousselli&rsquo;s wish to simplify the modern woman&rsquo;s beauty routine, GlideLiner Long Lasting Eye Pencil combines the benefits of a liquid liner with the application ease of a traditional pencil, while maintaining compatibility with Xtreme Lashes Eyelash Extensions. The silky-smooth gel formula glides on gently and easily, allowing you to achieve an ultra pigmented, precise, and perfectly defined eye. Must be used exclusively with the GlideLiner Sharpener. For external use only.</span>', 'Jo Mousselli的理想是希望簡化現代女性的化妝過程。GlideLiner眼線筆結合了眼線液及傳統眼線筆的優點，同時配合Xtreme Lashes&reg;的植睫技術。這種絲質柔順的啫喱配方有助更溫和和更容易地滑動，讓你更容易地勾畫出一對出色、細緻、輪廓分明的眼睛。此眼線筆只能使用GlideLiner的眼線筆刨，只供外部使用。', 'GLIDELINER', 'Glideliner™眼線筆', '27dflolhwyqsogcgww.png', '<title>{name} | Xtreme Lashes Hong Kong</title>\r\n        <meta name=\"description\" content=\"{description}\"/>\r\n        <meta name=\"robots\" content=\"noodp\"/>\r\n        <link rel=\"canonical\" href=\"{site_url}product/{slug}\" />\r\n        <meta property=\"og:locale\" content=\"en_US\" />\r\n        <meta property=\"og:type\" content=\"article\" />\r\n        <meta property=\"og:title\" content=\"{name} | Xtreme Lashes Hong Kong\" />\r\n        <meta property=\"og:description\" content=\"{description}\" />\r\n        <meta property=\"og:url\" content=\"{site_url}product/{slug}\" />\r\n        <meta property=\"og:site_name\" content=\"Xtreme Lashes Hong Kong\" />\r\n        <meta property=\"og:image\" content=\"{site_url}uploads/{thumbnail}\" />\r\n        <meta property=\"og:image:width\" content=\"328\" />\r\n        <meta property=\"og:image:height\" content=\"328\" />\r\n        <meta name=\"twitter:card\" content=\"summary\" />\r\n        <meta name=\"twitter:description\" content=\"{description}\" />\r\n        <meta name=\"twitter:title\" content=\"{name} | Xtreme Lashes Hong Kong\" />\r\n        <meta name=\"twitter:image\" content=\"{site_url}uploads/{thumbnail}\" />', '<title>{name_cn} | Xtreme Lashes Hong Kong</title>\r\n      <meta name=\"description\" content=\"{description_cn}\"/>\r\n      <meta name=\"robots\" content=\"noodp\"/>\r\n      <link rel=\"canonical\" href=\"{site_url}product/{slug}\" />\r\n      <meta property=\"og:locale\" content=\"en_US\" />\r\n      <meta property=\"og:type\" content=\"article\" />\r\n      <meta property=\"og:title\" content=\"{name_cn} | Xtreme Lashes Hong Kong\" />\r\n      <meta property=\"og:description\" content=\"{description_cn}\" />\r\n      <meta property=\"og:url\" content=\"{site_url}product/{slug}\" />\r\n      <meta property=\"og:site_name\" content=\"Xtreme Lashes Hong Kong\" />\r\n      <meta property=\"og:image\" content=\"{site_url}uploads/{thumbnail}\" />\r\n      <meta property=\"og:image:width\" content=\"328\" />\r\n      <meta property=\"og:image:height\" content=\"328\" />\r\n      <meta name=\"twitter:card\" content=\"summary\" />\r\n      <meta name=\"twitter:description\" content=\"{description_cn}\" />\r\n      <meta name=\"twitter:title\" content=\"{name_cn} | Xtreme Lashes Hong Kong\" />\r\n      <meta name=\"twitter:image\" content=\"{site_url}uploads/{thumbnail}\" />', 'glide-liner', 'https://youtube.com/embed/XvVsk5OPfgA,https://youtube.com/embed/pt5Y7Ij5Dwk', ''),
(57, '', '400.00', '', '', '<span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\"><span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">Design a dense lash look with this double-sided, felt-tip liquid eyeliner enriched with a lash-nourishing peptide also found in Amplifeye&reg; Advanced Lash &amp; Brow Fortifier. Developed to be compatible with Xtreme Lashes&reg; Eyelash Extensions, this easy to use liner ignites creativity and inspires confidence. This eyeliner is double-sided with the easy to control Precision Tip for filling in gaps along the lash line for a denser look and the Style Edge tip for creating a more dramatic look. From day to night, this long-lasting eyeliner provides precision, ease, and control in a Classic Black shade that is sure to turn heads.<br /></span></span>\n<ul>\n<li style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">Peptide-rich formula to nourish natural eyelashes</li>\n<li style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">Compatible with Xtreme Lashes<span style=\"vertical-align: baseline; position: relative; top: -0.4em;\">&reg;</span>&nbsp;Eyelash Extensions and natural lashes</li>\n<li style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">No flaking</li>\n<li style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">No build-up on the lash line</li>\n<li style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">Long-lasting</li>\n<li style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">Smudge-resistant</li>\n<li style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">Removes easily with Xtreme Lashes Eye Makeup Remover &amp; Facial Cleanser</li>\n<li style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">Hypoallergenic and dermatologist tested</li>\n<li style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">Two unique, easy to use tips</li>\n</ul>', '<span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">不晕染的眼线液 ... 持久不脫色， 這款雙尖液體眼線筆採用Amplifeye&reg;Advanced Lash＆Brow Fortifier精華液中的睫毛滋養肽，滋養自然睫毛， 專為XtremeLashes&reg; 植睫而設 。<br /><br /> 這款眼線筆易於控制， 採用雙頭設計，一邊筆頭筆觸極細， 讓能你輕鬆地勾畫出粗幼不一的實色線條， 可沿著睫毛線填充縫隙， 精細勾畫更濃密的妝感，另一邊採用Style Edge筆尖，打造大膽強烈妝容。<br /><br /> 可輕易使用Xtreme Lashes眼部卸妝液輕鬆卸除, 配方溫和， 防過敏和經皮膚科醫生測試。 <br /><br />水平存放以防止尖端乾燥並使液體均勻地流向兩個尖端。<br /><br /> 使用方法：使用前搖勻，使液體到達筆尖兩端。輕輕沿著眼線 （外眼角畫到內眼角或內眼角畫到外眼角）；畫出理想眼型， 保持手部穩定。</span>', 'Lash Densifying Liquid Eyeliner', 'XtremeLashes® 全新設計精華持久眼線液', '141271j7y3tw484kcg.jpg', '', '', 'lash-densifying-liquid-eyeliner', 'https://youtube.com/embed/knkFKeuOzBs', 'https://youtube.com/embed/knkFKeuOzBs'),
(58, '', '300.00', '<span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">Reveal a renewed complexion with an anti-aging concealer formulated to provide a <em>three-part holistic rejuvenation</em> to the skin. With continued use, the look of lines and wrinkles are diminished as skin appears visibly smoother, plumper, firmer, brighter, and more hydrated.</span>', '<span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\">抗老化配方為你肌膚再生， 展現重生的肌膚，遮暇精華液分開三部分， 全面令你的肌膚回復年輕。持續使用能有助減淡細紋及皺紋，令你的肌膚顯得更順滑、更有彈性、更緊緻、更明亮、更水潤。</span>', '<span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\"><span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\"><span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\"><strong>Corrective Prevention</strong>: Stimulate age intervention deep in the skin with encapsulated dipeptide Carnosine and antioxidants Silybum Marianum (milk thistle) fruit extract and Tocopherol (Vitamin E) delivered effectively via a liposomal complex. This trio of age-fighers work together to reduce the appearance of lines and wrinkles, revitalize skin, increase elasticity, and prevent the stiffening and breakdown of collagen through glycation. <br /> <strong>Hydration &amp; Anti-Inflammation</strong>: Inhibit inflammation and dryness with Australian Myrtle Oil and Bisabolol (derived from German Chamomile), both offering hydrating, anti-inflammatory, and anti-microbial properties to soothe redness and heal blemishes.<br /> <strong>Youthful Radiance</strong>: Counteract the look of dark shadows, lines and wrinkles, enlarged pores, and uneven skin tone around the entire eye area and throughout the face with long wear, light diffusing pigments.<br /><br /></span></span></span> <span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\"> <strong>Directions</strong>: Twist base of applicator to dispense product. Hide dark circles, reduce appearance of fine lines and wrinkles, and prime eyelids in one step by directly applying to both upper and lower eyelids. Pat gently using ring finger to blend for a seamless natural look. Conceal other imperfections by applying product as needed to areas of the face and blend using fingertips.<br /><strong>Warnings</strong>: Avoid direct contact with eyes. If any adverse reaction occurs, stop using the product. Inform your doctor if your condition persists. Keep away from children. <br /><strong>Storage/Shipping Conditions</strong>: Store in a cool, dry place between 68&deg;F - 77&deg;F (20&deg;C - 25&deg;C). Avoid direct sunlight, humidity and heat. Ensure that cap is firmly closed. <br /> <br /><strong>Made in Germany</strong></span>', '<span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\"><span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\"><span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\"><strong>修正防護</strong>: 激發肌膚深層的抗老化元素，包括肌肽及水飛薊(奶薊)抗氧化劑、水果精華、生育酚(維他命E)等，透過脂質體複合物有效傳送。這三種抗老化元素合作能減低臉上的細紋及皺紋、恢復肌膚活力、增強肌膚彈性、預防醣化中的膠原蛋白變硬及分解。 <br /> <strong>水合作用及抗炎性</strong>:以澳州香桃木油及紅沒藥醇(從德國洋甘菊提煉)滋潤肌膚、舒緩紅腫<br /> <strong>回復年輕光澤</strong>: 持久、輕微潤色有助對抗眼部附近或者面部的黑眼圈、細紋、皺紋、擴大的毛孔、不勻的膚色<br /><br /></span></span></span> <span style=\"color: #666666; font-family: lato, arial; font-size: 14px;\"> <strong>使用方法</strong>: 扭轉筆身以擠出產品。遮蓋黑眼圈，減少眼部細紋和皺紋。用無名指輕輕地推開遮瑕膏。產品亦可試用臉部或頸部，從而隱藏其他瑕疵。<br /><strong>警告</strong>: 避免與眼睛直接接觸。萬一接觸眼睛，用水沖洗眼睛15分鐘。如果發生任何不良反應，請停止使用本產品。如果病情持續發生，請通知您的醫生。本產品應遠離孩子。<br /><strong>儲存/運輸條件</strong>: 存放在68&deg;F至77&deg;F的陰涼乾燥處 （20℃〜25℃）。避免陽光直射，潮濕和熱。 <br /> <br /><strong>德國製造</strong></span>', 'Skin Renewing™ Concealer', '煥膚精華遮瑕膏', '2lujl8kiyl8g0ggso0.jpg', '', '', 'skin-renewing-concealer', 'https://youtube.com/embed/oBQvpSkmGTQ,https://youtube.com/embed/LPOq8-xOTss', 'https://youtube.com/embed/oBQvpSkmGTQ,https://youtube.com/embed/LPOq8-xOTss');
